ourse, to provide them with high-quality, safe and fun experience.<br><br>We believe that toys should provide high educational and developmental value for children, be comprehensive and engaging to play.<br>',NULL),(142,NULL,'2020-12-07 14:19:50.012361','2020-12-07 14:27:41.577599',70,1,1,'','Illustration','Illustration projects','/','',10,0,'','','','Revives \"boring\" multi-page commercial offers and reports. Fills ads with bright, memorable images. Decorates things.<br><br>When picking up a book, package, or toy, the vast majority of people first look at the illustrations. Vivid visual images can evoke a strong emotional response in people.<br>',NULL),(143,NULL,'2020-12-07 14:19:50.942347','2020-12-07 14:29:58.534592',71,1,1,'','Industrial','Industrial projects','/','',10,0,'','','','The product must be competitive and attractive. How to produce a product that meets these conditions? Industrial design becomes an integral part of product design, improvement, and commercial success.<br><br>Without a harmonious and functional design, it is impossible to complete in the modern market. We develop up-to-date design of consumer goods and electronic devices.<br>',NULL),(144,NULL,'2020-12-07 14:19:51.886355','2020-12-07 14:32:05.848785',72,1,1,'','Packaging','Packaging projects','/','',10,0,'','','','A characteristic feature of the modern market is a high level of competition. In such conditions, it is not enough just to release a quality product. It is equally important to present it correctly to potential consumers.<br><br>The original memorable packaging design helps in solving this problem. Effective product packaging design attracts attention, effective - makes people buy.<br>',NULL),(145,NULL,'2020-12-07 14:19:53.223351','2020-12-07 14:34:29.166189',73,1,1,'','Web','Web projects','/','',10,0,'','','','Online branding is the most important business engine in the modern world. Structured content allows you to work correctly to attract new customers and work with existing ones.<br><br>Our task is to design web user interfaces, websites or web applications. Unique design for each specific client, to provide high consumer properties and aesthetic qualities.<br>',NULL),(146,NULL,'2020-12-07 15:13:04.146812','2021-01-09 14:28:18.438097',68,1,1,'','Identity','Identity projects','/portfolio/identity/','',11,0,'','','','Developing an identity is a complex task, the correct approach to which allows you to form the \"face\" of a brand or company.<br>Corporate identity is the interaction of all visual elements used for communication with the target audience.<br><br>We take into account how corporate colors, fonts and graphics will look in different conditions and on different media - indoors and outdoors, in bright and low light, on a poster and on a small business card.<br>',''),(147,NULL,'2020-12-07 15:13:04.147885','2021-01-09 14:47:02.603083',69,1,1,'','Toys','Toys projects','/portfolio/toys/','',11,0,'','','','Toy design main goal is to contribute to growth and development of children, encourage their imagination and use of various skills, and, of course, to provide them with high-quality, safe and fun experience.<br><br>We believe that toys should provide high educational and developmental value for children, be comprehensive and engaging to play.&nbsp;Our team consists of people who devote themselves completely to creating toys, people who, despite their age, remain children in their souls. Each of us tries to feel the gameplay and bring something new, useful in our own way.<br>',''),(148,NULL,'2020-12-07 15:13:04.148855','2021-06-07 20:24:38.693416',70,1,1,'','Illustration','Illustration projects','/portfolio/illustration/','',11,0,'','','','Revives \"boring\" multi-page commercial offers and reports. Fills ads with bright, memorable images. Decorates things.<br><br>When picking up a book, package, or toy, the vast majority of people first look at the illustrations. Vivid visual images can evoke a strong emotional response in peopl