mbly is made by the kid and his parents thanks to big screws on the side, allowing it to be delivered flat-packed',''),(255,'255.jpg','2021-01-06 11:15:49.763017','2021-01-08 18:40:26.256582',115,1,1,'','Picture_1','','','',23,0,'','','','',''),(256,'256.jpg','2021-01-06 11:15:51.224746','2021-01-08 18:40:33.467746',116,1,1,'','Picture_2','','','',23,0,'','','','',''),(257,'257.jpg','2021-01-06 11:15:52.976594','2021-01-08 18:40:37.942581',117,1,1,'','Picture_3','','','',23,0,'','','','',''),(260,NULL,'2021-01-06 11:20:35.685294','2021-06-02 18:25:08.211425',114,1,1,'','Text','这个方案是为纯意大利技术木制玩具制造商而设计的Logo和名称。在意大利，制作木制玩具的奥秘世代传承，是真正的传家宝。','','',25,0,'','','商标设计 - LOGO设计 - 玩具设计 - 玩具LOGO - 插图设计','<div>AVITO. Our task was to develop a logo and a brand name for a manufacturer of wooden toys which are produced using Italian technology and with an Italian design.&nbsp;<span style=\"background-color: initial;\">In Italy, the secrets of the production of wooden toys made are inherited and are a real heirloom.&nbsp;<br><br></span><span style=\"background-color: initial;\">Therefore, we proposed the name \"Avito\", which means \"hereditary\" in Italian.&nbsp;</span><span style=\"background-color: initial;\">We played with the words and found another consonant word in Italian – Aviatore (aviator) and decided to combine these things into one visual image.&nbsp;<br><br></span><span style=\"background-color: initial;\">The image of an airplane in a retro style and a plush toy pilot at the helm evoke memories from childhood, and the warm and gentle color scheme emphasizes this.&nbsp;</span><span style=\"background-color: initial;\">Off we go!</span></div>',''),(261,'261.jpg','2021-01-06 11:20:35.690443','2021-05-24 10:09:58.985127',115,1,1,'','Picture_1','','','',25,0,'','','','',''),(262,'262.jpg','2021-01-06 11:20:35.696634','2021-01-08 19:47:39.333814',116,1,1,'','Picture_2','','','',25,0,'','','','',''),(263,'263.jpg','2021-01-06 11:20:35.703091','2021-01-15 19:03:54.919605',117,1,1,'','Picture_3','','','',25,0,'','','','',''),(264,NULL,'2021-01-06 11:33:22.892518','2021-02-27 14:21:45.939244',114,1,1,'','Text','','','',26,0,'','','','Design of children\'s furniture for kindergarten.&nbsp; <br><br>In the studio, by special order, we have developed baby furniture for kindergartens in the city of Yunhe. With this wooden table and two chairs made of bent plywood in the shape of animals, painted in delicate colors, children can draw and play as they wish. The set is designed for two children, and in total, up to 10 sets can be placed in a group of a kindergarten. Chairs and tables are adapted to the parameters of children from 3 to 5 years old. The table has a diameter of 60 cm and a height of 47 cm. The chairs are 50 cm high. In the center of the table is a special cutout for a plastic stand-glass, which allows storing pens and pencils. The lego stand is retractable for easy cleaning and maintenance. Funny prints with animals on the backs of chairs will not leave children indifferent.',''),(265,'265.jpg','2021-01-06 11:33:22.896308','2021-05-24 10:28:54.075154',115,1,1,'','Picture_1','','','',26,0,'','','','',''),(266,'266.jpg','2021-01-06 11:33:22.903945','2021-01-09 16:30:42.354069',116,1,1,'','Picture_2','','','',26,0,'','','','',''),(267,'267.jpg','2021-01-06 11:33:22.912161','2021-01-09 16:31:07.420414',117,1,1,'','Picture_3','','','',26,0,'','','','',''),(268,NULL,'2021-01-06 11:40:46.043856','2021-06-07 19:13:46.883168',4,1,4,'_13_14','AVITO toys','','/portfolio/identity/avito/','',2,0,'','','','',''),(269,NULL,'2021-01-06 11:41:33.067366','2021-06-07 19:13:46.890732',5,1,4,'_13_14','Chestnut Trade','','/portfolio/identity/chestnut-trade/','',2,0,'','','','',''),(270,NULL,'2021-01-06 11:41:40.142135','2021-06-07 19:13:46.897400',6,1,4,'_13_14','COCOCAM','','/portfolio/identity/cococam/','',2,0,'','','','',''),(271,NULL,'2021-01-06 11:48:26.285424','2021-01-28 14:43:01.501006',114,1,1,'','Text','','','',27,0,'','','','<div>Chestnut Trade is a young company that deals with the logistics of goods from China.&nbsp;<span style=\"background-color: initial;\">In the studio, we created an unexpected and memorable logo.&nbsp;</span><span style=\"background-color: initial;\">The task was not easy, but we got out of the situation by coming up with a non-trivial image.&nbsp;<br><br></span><span style=\"background-color: initial;\">We \"superimposed\" images of cargo containers&nbsp;</span><span style=\"background-color: initial;\">on the silhouette of the chestnut fruit and made an asymmetric composition with a text block, getting a modern logo.&nbsp;<br><br></span><span style=\"background-color: initial;\">It sounds strange, but unusual solutions often work!</span></div>',''),(272,'272.jpg','2021-01-06 11:48:26.288699','2021-05-24 10:14:55.936881',115,1,1,'','Picture_1','','','',27,0,'','','','',''),(273,'273.jpg','2021-01-06 11:48:26.294523','2021-01-09 16:45:51.527242',116,1,1,'','Picture_2','','','',27,0,'','','','',''),(274,'274.jpg','2021-01-06 11:48:26.302034','2021-01-09 16:45:55.039450',117,1,1,'','Picture_3','','','',27,0,'','','','',''),(275,'275.jpg','2021-01-06 11:51:13.399980','2021-01-09 16:45:58.548217',123,1,1,'','Picture_4','','','',27,0,'','','','',''),(276,'276.jpg','2021-01-06 11:51:38.341139','2021-01-09 16:46:01.508865',124,1,1,'','Picture_5','','','',27,0,'','','','',''),(277,'277.jpg','2021-01-06 11:52:00.775894','2021-01-09 16:46:04.502396',125,1,1,'','Picture_6','','','',27,0,'','','','',''),(278,'278.jpg','2021-01-06 11:52:01.816908','2021-01-15 19:11:48.363809',126,1,1,'','Picture_7','','','',27,0,'','','','',''),(279,'279.jpg','2021-01-06 11:53:54.696888','2021-01-09 16:46:39.984686',127,1,1,'','Picture_8','','','',27,0,'','','','',''),(280,'280.jpg','2021-01-06 11:53:58.091409','2021-01-09 16:46:19.305663',128,1,1,'','Picture_9','','','',27,0,'','','','',''),(282,NULL,'2021-01-06 11:59:59.408724','2021-06-07 19:13:47.024244',130,1,4,'_13_16','Children furniture','','/portfolio/t