,35,0,'','','','',''),(386,'386.jpg','2021-01-08 18:36:17.747783','2021-01-08 18:41:26.112502',116,1,1,'','Picture_2','','','',35,0,'','','','',''),(387,'387.jpg','2021-01-08 18:36:17.755598','2021-01-09 16:25:28.764090',117,1,1,'','Picture_3','','','',35,0,'','','','',''),(388,NULL,'2021-01-08 18:54:21.091032','2021-01-28 15:11:54.261336',114,1,1,'','Text','','','',36,0,'','','','<div>COCOCAM. Manufacturer of photo and video traps for hunters and wildlife lovers.&nbsp;<span style=\"background-color: initial;\">With these cameras, you will be able to see things that you will never see with your own eyes.&nbsp;</span><span style=\"background-color: initial;\">The camera is stealthily mounted on a tree or masked with rocks and when an animal passes near the camera, it automatically activates video recording, takes photos, and transmits images to your phone.&nbsp;</span><span style=\"background-color: initial;\">The secrets of the animal world are now coming into the light.&nbsp;<br><br></span><span style=\"background-color: initial;\">We created a logo with an original text part, taking into account the stylistic preferences of buyers of the North American market of the US and Canada.<br><br></span><span style=\"background-color: initial;\">The text part of the logo is technological and modern, which symbolizes the quality of the products, and the sign with the image of the lens reminds that no one and nothing will hide from the sharp eye of the camera trap.</span></div>',''),(389,'389.jpg','2021-01-08 18:54:21.096280','2021-05-24 10:15:14.380083',115,1,1,'','Picture_1','','','',36,0,'','','','',''),(390,'390.jpg','2021-01-08 18:54:21.103748','2021-01-08 18:54:21.103780',116,1,1,'','Picture_2','','','',36,0,'','','','',''),(391,'391.jpg','2021-01-08 18:54:21.112294','2021-01-08 18:54:21.112320',117,1,1,'','Picture_3','','','',36,0,'','','','',''),(392,'392.jpg','2021-01-08 18:55:21.166680','2021-01-08 18:56:30.970111',183,1,1,'','Picture_4','','','',36,0,'','','','','