about building a business in China.&nbsp;</span><span style=\"background-color: initial;\">They help to determine the main goals and stages as well as develop individual solutions for business development and entering the Chinese market.&nbsp;</span><span style=\"background-color: initial;\">In the studio, we made a logo with a red label for Marketing Atelier.<br><br></span><span style=\"background-color: initial;\">The red label is a sign of the excellent quality of services provided to customers around the world!&nbsp;</span><span style=\"background-color: initial;\">Strict and bright with a balanced composition it creates a tone of communication corresponding to the international status, authority, and dynamics of the company\'s development.<br><br></span><span style=\"background-color: initial;\">Also, we have developed templates for business and office documentation in three languages, which would facilitate communication with customers and partners without losing the original handwriting.</span></div>',''),(403,'403.jpg','2021-01-08 19:52:21.683273','2021-05-24 10:16:04.659798',115,1,1,'','Picture_1','','','',38,0,'','','','',''),(404,'404.jpg','2021-01-08 19:52:21.689690','2021-01-08 20:24:34.372933',116,1,1,'','Picture_2','','','',38,0,'','','','',''),(405,'405.jpg','2021-01-08 19:52:21.696546','2021-01-08 20:24:44.452833',117,1,1,'','Picture_3','','','',38,0,'','','','',''),(414,NULL,'2021-01-08 19:55:27.744520','2021-02-27 14:36:43.218373',114,1,1,'','Text','','','',41,0,'','','','<div>The industrial design of Workbench Transformer toy.<br><br>Client: Lucy &amp; Leo&nbsp;</div><div>Lucy &amp; Leo is a Spanish brand that produces educational wooden toys for children in its own factory in China. We designed this transformable modular plywood workbench specifically for small carpenters. For easy assembly of a toy for a child or his mother we have come up with a modular fastening system with large bolts and nuts made of plastic to fix all the elements in the assembly. It also allows to sell and deliver the kitchen disassembled in a flat package as a construction kit. The workbench has 2 transformation modes! The 1st is the workbench mode for the carpenter, the 2nd is the tablet mode for drawing. Play is even more interesting! The kit includes tools made of plastic and wood with different functions so that the child can reproduce a full-fledged imitation of the carpenter\'s work and learn new skills.</div>',''),(415,'415.jpg','2021-01-08 19:55:27.749269','2021-01-08 20:26:25.702425',115,1,1,'','Picture_1','','','',41,0,'','','','',''),(416,'416.jpg','2021-01-08 19:55:27.755153','2021-01-08 20:26:34.329245',116,1,1,'','Picture_2','','','',41,0,'','','','',''),(417,'417.jpg','2021-01-08 19:55:27.760150','2021-01-24 16:44:00.466856',117,1,1,'','Picture_3','','','',41,0,'','','','',''),(418,NULL,'2021-01-08 19:56:06.649047','2021-02-27 14:43:40.685958',114,1,1,'','Text','','','',42,0,'','','','<div>\"Forest tree\" wall toy design and Illustrations.</div><div>Client: Lucy &amp; Leo.</div><div>Lucy &amp; Leo is a Spanish brand that produces educational wooden toys for children in its own factory in China. For the brand Lucy &amp; Leo in the studio, we designed this wall toy specifically for use at home or in kindergartens. The toy fits perfectly into any interior. The \"Forest Tree\" wall toy is a great and unusual toy for young children, and unlike most other toys, it is attached directly to the wall! A vivid illustration shows all sorts of funny forest animals that live on a large green tree. The tree has special branches-slides and smooth colored wooden balls that roll down them. When the ball is placed on the top branch it rushes to the base of the tree, rolling and banging along the way. The toy is great for active children who like to move objects, develop motor skills and promote the study of color. We have selected high-quality wood and plywood, designed a simple but reliable structure and created fun characters which will provide many hours of exciting gameplay!</div>',''),(419,'419.jpeg','2021-01-08 19:56:06.654560','2021-05-24 10:28:00.274274',115,1,1,'','Picture_1','','','',42,0,'','','','',''),(420,'420.jpg','2021-01-08 19:56:06.660270','2021-01-08 19:56:06.660296',116,1,1,'','Picture_2','','','',42,0,'','','','',''),(421,'421.jpg','2021-01-08 19:56:06.666614','2021-01-08 19:56:06.666642',117,1,1,'','Picture_3','','','',42,0,'','','','',''),(422,NULL,'2021-01-08 19:56:38.369716','2021-02-27 14:54:18.190348',114,1,1,'','Text','','','',43,0,'','','','<div>Design and illustrations for a pool with a splash pool fountain.<br><span style=\"background-color: initial;\"><br>Client: Vatos&nbsp;</span></div><div>In the studio we developed the design and illustrations for the Vatos brand pool. This small but very cozy pool with a fountain will appeal to every child. Along the perimeter of the sides there are small holes through which water splashes in thin streams, cooling the swimmers on a hot summer day, and in the center of the pool there is a real fountain! To operate the fountains you will need a regular garden hose with a water pressure which is connected to a special hole in the pool. We did not stop at the design and offered the client to create an interesting illustration for the pool. We took the idea of a space theme and made funny prints with flying saucers and alien monsters. It will be difficult to get children out of such a pool!</div>',''),(423,'423.jpg','2021-01-08 19:56:38.374667','2021-05-24 10:31:23.196051',115,1,1,'','Picture_1','','','',43,0,'','','','',''),(424,'424.jpg','2021-01-08 19:56:38.380895','2021-01-08 19:56:38.380924',116,1,1,'','Picture_2','','','',43,0,'','','','',''),(425,'425.jpg','2021-01-08 19:56:38.387374','2021-01-08 19:56:38.387401',117,1,1,'','Picture_3','','','',43,0,'','','','',''),(426,NULL,'2021-01-08 19:57:33.924885','2021-02-27 14:48:14.046285',1,1,1,'','Text','','','',44,0,'','','','Design and illustrations for knocker toy.<br><br>Client: Obro toys <br><br>Obro toys is a European brand of educational and development toys made of wood. For the brand Obro Toys in the studio, we developed a toy-knocker for children from 2 years old. To make the toy different from similar \"knockers\" of competitors, we decided to implement the idea with space and an unusual shape of the toy body. The space adventure begins! Little astronauts will have an exciting mission - to hit bright pegs in the form of aliens and balls on the surface of a distant planet. Active kids will especially like this toy because we made it two-sided. When all the pegs are driven in you can turn the toy over and continue the game on another planet. The play will never end!',''),(427,'427.jpg','2021-01-08 19:57:33.930368','2021-01-15 19:22:13.080294',8,1,1,'','Picture_7','','','',44,0,'','','','',''),(428,'428.jpg','2021-01-08 19:57:33.939146','2021-01-08 19:57:33.939192',3,1,1,'','Picture_2','','','',44,0,'','','','',''),(429,'429.jpg','2021-01-08 19:57:33.960493','2021-01-08 19:57:33.960522',4,1,1,'','Picture_3','','','',44,0,'','','','',''),(430,NULL,'2021-01-08 19:58:40.310714','2021-05-30 18:20:05.745699',1,1,1,'','Text','','','',45,0,'','','','<div>Attractive design for kids and adults alike.</div><div>The humidifier is designed for children with respiratory diseases or dry skin. Special scents and decontaminating additives can be added to the water. Its attractive little bird-like design is designed to encourage children to use it in their bedroom, but it also fits into any room of your home thanks to its minimalist and modern design.</div>',''),(431,'431.jpg','2021-01-08 19:58:40.315528','2021-01-16 15:53:26.252243',3,1,1,'','Picture_2','','','',45,0,'','','','',''),(432,'432.jpg','2021-01-08 19:58:40.321582','2021-01-08 19:58:40.321609',4,1,1,'','Picture_2','','','',45,0,'','','','',''),(433,'433.jpg','2021-01-08 19:58:40.326567','2021-05-24 10:38:24.999287',2,1,1,'','Picture_1','','','',45,0,'','','','',''),(434,NULL,'2021-01-08 19:59:22.780253','2021-02-08 15:47:24.640226',114,1,1,'','Text','','','',46,0,'','','','Our goal was to create a sleek yet elegant internet router that would fit into every living room. We worked hand in hand with the engineers to find a balance between a good style and a cost-effective functional form to provide a reliable internet signal. Special attention is paid to air vents, which are necessary and often become a design constraint that makes the product look too \"technological\". Here we took the opportunity to use them as a graphic design element. The result fully justified our innovative solutions.',''),(435,'435.jpeg','2021-01-08 19:59:22.786092','2021-05-24 10:36:52.412746',115,1,1,'','Picture_1','','','',46,0,'','','','',''),(436,'436.jpg','2021-01-08 19:59:22.792038','2021-01-08 19:59:22.792059',116,1,1,'','Picture_2','','','',46,0,'','','','',''),(437,'437.jpg','2021-01-08 19:59:22.799203','2021-01-08 19:59:22.799219',117,1,1,'','Picture_3','','','',46,0,'','','','',''),(438,NULL,'2021-01-08 20:00:18.704738','2021-02-08 15:59:06.442681',1,1,1,'','Text','','','',47,0,'','','','Magic Tikino projector for a curious child! Immerse yourself in a friendly, fun and poetic universe, perfect for kids to dream, have fun, learn and discover new things without tablets or phones. \"Tikino\" is a video projector for children, projecting educational and interactive content. Its shape resembles a telescope or an antique camera with rounded edges that make it easier for a child to use and ensure safety. It projects animated images on any light surface and is perfect for a children\'s room.',''),(439,'439.jpg','2021-01-08 20:00:18.708486','2021-01-16 15:54:11.177000',4,1,1,'','Picture_3','','','',47,0,'','','','',''),(440,'440.jpg','2021-01-08 20:00:18.714678','2021-05-24 10:38:45.472149',2,1,1,'','Picture_2','','','',47,0,'','','','',''),(441,'441.jpg','2021-01-08 20:00:18.720202','2021-01-16 15:54:24.009273',6,1,1,'','Picture_1','','','',47,0,'','','','',''),(442,NULL,'2021-01-08 20:00:55.677076','2021-06-02 17:50:10.086532',1,1,1,'','Text','我们为旱冰，自行车和滑板等运动制作了儿童通用头部护具——安全头盔。','','',48,0,'','LOGO设计,包装设计,插图设计,工业设计,品牌设计,上海设计公司,玩具设计,网站设计,产品设计','Infinity ink - 母婴用品设计 - 儿童用品设计 - 儿童头盔设计 - 工业设计','In the studio we created a children\'s universal helmet to protect the head when skating on roller skates, bicycles and skateboards. We have a well-designed ventilation system and positioned the ventilation holes so that fresh air is always supplied in sufficient quantities and ensures good recirculation when riding. Air vents are also an integral part of the design. The helmet was given a special shape for additional protection of the back of the head and the area around the ears. We also paid attention to the graphic component of the helmet.&nbsp; It has a bright color with a lightning pattern, which makes it even more attractive for young riders.',''),(443,'443.jpg','2021-01-08 20:00:55.680842','2021-01-16 15:52:17.891714',3,1,1,'','Picture_2','','','',48,0,'','','','',''),(444,'444.jpg','2021-01-08 20:00:55.686821','2021-05-24 10:37:51.069328',2,1,1,'','Picture_1','','','',48,0,'','','','',''),(446,NULL,'2021-01-08 20:01:32.969862','2021-02-08 17:13:49.906810',1,1,1,'','Text','','','',49,0,'','','','<div><span style=\"background-color: initial;\">We have designed a simple portable Wi-Fi signal booster that can be installed anywhere in the home. The shape of the expander we created in the studio is a triangle. The triangle is the most compact form for placing two electronic cards and three antennas inside the product, which makes it efficient, but at the same time ergonomic. We paid special attention to the appearance and feelings: this product is designed so that it can be organically placed in any room at home or in the office, so we made it as unobtrusive as possible. For this reason, we stuck to a minimalist style, adding elegant colors and rich texture to give it a stylish look.</span><br></div>',''),(447,'447.jpg','2021-01-08 20:01:32.975194','2021-01-16 15:55:03.145788',5,1,1,'','Picture_4','','','',49,0,'','','','',''),(448,'448.jpg','2021-01-08 20:01:32.980835','2021-05-24 10:39:09.763497',2,1,1,'','Picture_2','','','',49,0,'','','','',''),(449,'449.jpg','2021-01-08 20:01:32.984787','2021-01-08 20:01:32.984803',3,1,1,'','Picture_3','','','',49,0,'','','','',''),(450,NULL,'2021-01-08 20:02:04.313758','2021-05-12 14:53:13.884956',114,1,1,'','Text','','','',50,0,'','','','Client: LSHBC<br>LSHBC website.<br><a href=\"https://www.sh-leo.com/\">www.sh-leo.com</a><br><br>Website design for a consulting company in China. The company is engaged in consulting services in the field of business and manufacturing in China and also offers services for the organization of exhibitions, legal services and professional translation during negotiations. Since all directions are equally important, the studio has developed a design that emphasizes their equivalence. In the catalog of services everything is grouped by directions, it is convenient to navigate and immediately find what you need. In each block the client will find the necessary information and use the feedback service to leave a request for the desired product. The design of the site is made in a business style and restrained color scheme. Specifically to make the graphics more interesting, we added monochrome photos of interesting and beautiful views of places in China, as well as photos of moments from the life of the company.<br>',''),(451,'451.jpg','2021-01-08 20:02:04.319503','2021-05-24 10:44:28.530817',115,1,1,'','Picture_1','','','',50,0,'','','','',''),(452,'452.jpg','2021-01-08 20:02:04.324980','2021-01-08 20:02:04.324998',116,1,1,'','Picture_2','','','',50,0,'','','','',''),(453,'453.jpg','2021-01-08 20:02:04.329586','2021-01-08 20:02:04.329618',117,1,1,'','Picture_3','','','',50,0,'','','','',''),(454,NULL,'2021-01-08 20:02:33.099190','2021-03-01 10:51:24.175631',114,1,1,'','Text','','','',51,0,'','','','Client: MotorData Professional<br><br>MotorData OBD&nbsp; <br><br>Design of widgets and interfaces for the car diagnostics program. MotorData OBD is an Android application for diagnosing and displaying real-time vehicle operation data: reading and clearing codes, reading stop frames and current data. Widgets help to display all the necessary information about the current state of the car in the app on your mobile device. We have developed 3 styles of graphics for widgets, which, thanks to the modular grid we have created, can be assembled into a single block and simultaneously track several indicators of your car\'s engine performance, speed, gasoline consumption, transmission temperature, and much more. All the data is packed in convenient graphs and gauges, a special set of contrasting colors makes it easy to read information at any time of the day and on any mobile device.',''),(455,'455.jpg','2021-01-08 20:02:33.104745','2021-05-24 10:44:47.832008',115,1,1,'','Picture_1','','','',51,0,'','','','',''),(456,'456.jpg','2021-01-08 20:02:33.113816','2021-01-08 20:02:33.113868',116,1,1,'','Picture_2','','','',51,0,'','','','',''),(457,'457.jpg','2021-01-08 20:02:33.120225','2021-01-08 20:02:33.120246',117,1,1,'','Picture_3','','','',51,0,'','','','',''),(458,NULL,'2021-01-08 20:02:56.735751','2021-03-01 11:01:42.266910',114,1,1,'','Text','','','',52,0,'','','','Client: Naviaddress <br><br>Design and graphics for social networks of the Naviaddress company.<br><br> Naviaddress is a smart digital address for any place and object. It combines postal address, coordinates, digitized and searchable data about your object or location. Using the Naviaddress platform makes it easier to navigate on the last mile. We have created templates and graphics for the company to use for branding on social networks like Instagram Facebook, Linkedin, Instagram, and others. Graphic identification for social networks helps to quickly and efficiently convey the necessary information to the client. And the templates will help to easily adapt any graphics to the overall style of the brand and help the company\'s employees to fill in social networks independently.<br><br><a href=\"www.instagram.com/naviaddress/\">www.instagram.com/naviaddress/</a><br>',''),(459,'459.jpg','2021-01-08 20:02:56.740015','2021-05-24 10:45:07.722610',115,1,1,'','Picture_1','','','',52,0,'','','','',''),(460,'460.jpg','2021-01-08 20:02:56.745394','2021-01-08 20:02:56.745411',116,1,1,'','Picture_2','','','',52,0,'','','','',''),(461,'461.jpg','2021-01-08 20:02:56.749257','2021-01-08 20:02:56.749278',117,1,1,'','Picture_3','','','',52,0,'','','','',''),(462,NULL,'2021-01-08 20:03:48.851812','2021-05-23 16:21:36.968726',114,1,1,'','Text','','','',53,0,'','','','Client: Jumbo Toys<br><a href=\"https://infinityink.cn/flatcontent/admin/flatpages/tree/53/www.jumbo-toys.ru\">www.jumbo-toys.ru</a><br><br> The \"Jumbo Toys\" company produces and distributes toys, as well as children\'s bicycles, scooters and sporting goods. Customers of Jumbo Toys are wholesale and retail companies, online stores and trading platforms, large federal networks of Russia. To make it easy for sellers and buyers to manage a huge number of items, we designed an online store with a set of useful features. Special attention is paid to the formation of the cart. Hundreds of items are placed here, and access to it is provided, if necessary, to several employees responsible for purchasing. When customers are only interested in certain types of products, such as everything that is suitable for a bicycle store, a favorites catalog is formed. Separate positions corresponding to the search query are entered in it. The site is maintained and updated by the employees of the company.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br>',''),(463,'463.jpg','2021-01-08 20:03:48.856784','2021-06-01 12:52:41.025913',115,1,1,'','Picture_1','','','',53,0,'','','','',''),(464,'464.jpg','2021-01-08 20:03:48.863385','2021-01-08 20:03:48.863417',116,1,1,'','Picture_2','','','',53,0,'','','','',''),(465,'465.jpg','2021-01-08 20:03:48.868678','2021-01-08 20:03:48.868712',117,1,1,'','Picture_3','','','',53,0,'','','','',''),(466,NULL,'2021-01-08 20:05:10.401324','2021-03-01 11:09:28.384044',114,1,1,'','Text','','','',54,0,'','','','Client: Lucy&amp;Leo toys <br><br>Lucy&amp;Leo online store design<br><br>Page design for an online store on the Taobao platform. Lucy&amp;Leo toys is a Spanish brand that develops and manufactures educational toys made of wood. Toys are successfully sold in Europe, Latin America and Russia. In 2020, the company began entering the Chinese market and offers customers high-quality wooden toys - wholesale and retail. For the design of the online store on the Taobao platform, we have developed a design of page templates for PC and mobile devices. In the design we used the brand\'s proprietary graphics and illustrations. Toy pages are created by the company\'s employees according to the templates we created, and we also made templates for creating advertising banners for new products and marketing events of the company.',''),(467,'467.jpg','2021-01-08 20:05:10.406589','2021-05-24 10:44:08.167875',115,1,1,'','Picture_1','','','',54,0,'','','','',''),(468,'468.jpg','2021-01-08 20:05:10.412943','2021-01-08 20:05:10.412963',116,1,1,'','Picture_2','','','',54,0,'','','','',''),(469,'469.jpg','2021-01-08 20:05:10.422000','2021-01-08 20:05:10.422040',117,1,1,'','Picture_3','','','',54,0,'','','','',''),(470,NULL,'2021-01-08 20:05:50.057001','2021-03-01 11:19:36.145209',114,1,1,'','Text','','','',55,0,'','','','Client: Obro toys <br><br>Page design for an online store on the Taobao platform. <br><br>Obro toys is a European start-up brand that develops and produces educational toys made of wood. Obro toys are successfully sold in Europe and Russia. Now the company is going to enter the Chinese market. For these purposes, it was decided to use the Taobao market platform. To design an online store, the company turned to us. In the studio we developed the design of page templates for PC and mobile devices. In the design we used the brand\'s proprietary graphics and illustrations. The pages for toys are created by the company\'s employees according to the templates created by us, and we also made templates for creating advertising banners for new products and marketing events of the company. We wish Obro toys a successful promotion in China and good sales!',''),(471,'471.jpg','2021-01-08 20:05:50.062177','2021-05-24 10:45:41.879308',115,1,1,'','Picture_1','','','',55,0,'','','','',''),(472,'472.jpg','2021-01-08 20:05:50.068370','2021-01-08 20:05:50.068392',116,1,1,'','Picture_2','','','',55,0,'','','','',''),(473,'473.jpg','2021-01-08 20:05:50.073337','2021-01-08 20:05:50.073354',117,1,1,'','Picture_3','','','',55,0,'','','','',''),(474,NULL,'2021-01-08 20:08:14.707638','2021-03-01 10:32:50.786896',1,1,1,'','Text','','','',56,0,'','','','<div>Client: Sisland Co. Ltd<br><br><span style=\"background-color: initial;\">Packaging for the game of monster darts.<br><br></span><span style=\"background-color: initial;\">Unlike regular darts in monster darts, in addition to the usual field, there is an additional playing field with a monster. Hitting darts in different parts of the playing field you earn points. The player who knocks out the most points wins. In the studio, we drew illustrations for the playing fields and packaging with the logo for the game. On the packaging, as well as on the playing field, we have drawn funny monsters that attract the attention of small darts players and make the game fun and interesting. The darts will be sold at the Amazon site in the US and Canada so the style of the illustrations on the packaging and the playing field is maximally adapted for North American buyers.</span></div>',''),(475,'475.jpg','2021-01-08 20:08:14.711841','2021-01-16 15:57:36.826906',3,1,1,'','Picture_7','','','',56,0,'','','','',''),(476,'476.jpg','2021-01-08 20:08:14.717674','2021-05-24 10:54:38.940618',2,1,1,'','Picture_2','','','',56,0,'','','','',''),(477,'477.jpg','2021-01-08 20:08:14.721899','2021-01-16 15:59:39.988732',6,1,1,'','Picture_1','','','',56,0,'','','','',''),(478,NULL,'2021-01-08 20:08:51.597453','2021-02-27 13:39:48.998124',114,1,1,'','Text','','','',57,0,'','','','<div>Client: Beijing Hydrovita<br><br><span style=\"background-color: initial;\">Molecular Hydrogen Water Packaging Concept.<br><br></span><span style=\"background-color: initial;\">Drinking hydrogen water is the most common way to treat diseases. The concept of hydrogen-rich water came from Japan. In 2013, the market size in Japan reached 200 billion yen. Beijing Hydrovita has acquired the main technology to overcome the difficulties associated with the insolubility of hydrogen in water and became the first company in China to produce water rich in hydrogen. In the studio, we developed a package for water enriched with hydrogen in a minimalistic and concise style, which looks equally advantageous on the shelves in the pharmacy and on the counter of the store. The amount of hydrogen content in water is different: 1.1, 1.8, and 2.0. So that the buyer could visually distinguish these indicators we came up with a color code for the packaging - from light to dark. The higher the hydrogen content — the darker the color of the package, while the package still looks \"light\" and informative.</span></div>',''),(479,'479.jpg','2021-01-08 20:08:51.601316','2021-05-24 10:54:57.436123',115,1,1,'','Picture_1','','','',57,0,'','','','',''),(480,'480.jpg','2021-01-08 20:08:51.606809','2021-01-09 16:30:16.612884',116,1,1,'','Picture_2','','','',57,0,'','','','',''),(482,NULL,'2021-01-08 20:09:36.249555','2021-03-01 10:38:17.716991',1,1,1,'','Text','','','',58,0,'','','','Client: Arman. <br><br>In the studio we created a special packaging for an ice cream manufacturer from Xinjiang Province, China. \"Kar Pari\" is a Xinjiang local brand owned by Arman company. Ice cream from \"Kar Pari\" is an incredible pleasure here and now! It is distinguished by an original recipe from an Italian pastry chef and only natural ingredients in the preparation. There are 9 flavors in the series: Chocolate, Pistachio, Tiramisu, Hazelnut, Cream, Strawberry, Vanilla, Mint and Wild Berries. For each taste we have created an individual package with the image of the main ingredient and its color code. The shtick of the package is a dessert spoon with an ingredient on it. Indeed, because the taste of ice cream is so bright that it feels like you\'re actually eating whole berries or nuts.',''),(483,'483.jpg','2021-01-08 20:09:36.254936','2021-01-16 16:11:25.755758',4,1,1,'','Picture_3','','','',58,0,'','','','',''),(484,'484.jpg','2021-01-08 20:09:36.260633','2021-01-08 20:09:36.260649',3,1,1,'','Picture_2','','','',58,0,'','','','',''),(485,'485.jpg','2021-01-08 20:09:36.265742','2021-05-24 10:55:15.216724',2,1,1,'','Picture_1','','','',58,0,'','','','',''),(486,NULL,'2021-01-08 20:10:11.233337','2021-06-02 18:28:36.899095',114,1,1,'','Text','','','',59,0,'','LOGO设计,商标设计,包装设计,插图设计,工业设计,品牌设计,上海设计公司,玩具设计,网站设计,产品设计','Infinityink - 商标设计 - LOGO设计 - 玩具商标设计 - 玩具设计','<div></div><div></div>Client: Arman <br><br>Packaging for steamed buns. <br><br>In the studio, we created the steamed bun packaging specifically for the local market in Xinjiang. At night, when the whole city of Urumqi is asleep, the \"Arman\" factory prepares delicious steamed buns, and early in the morning, they are delivered to the shops — so the buns from Arman are always fresh. For the design of the vacuum packaging, which keeps the baking fresh all day we used the graphic style used in the design of European bakeries. This is a pattern-print with hand-drawn buns, croissants, baguettes, wheatears and names of bakery products in different languages. The color scheme is dominated by one bright color with monochrome extras, which makes the packaging very \"home\". In order for the customer to appreciate the freshness of the products, we left as much space as possible on the packaging for a transparent window. This way the buyer can always see and make sure of the freshness of these delicious buns.<div></div><div></div>',''),(487,'487.jpg','2021-01-08 20:10:11.237186','2021-05-24 10:54:16.082769',115,1,1,'','Picture_1','','','',59,0,'','','','',''),(490,NULL,'2021-01-08 20:10:43.138668','2021-03-01 10:34:10.910299',114,1,1,'','Text','','','',60,0,'','','','<div><span style=\"background-color: initial;\">Client: INATECK<br><br></span><span style=\"background-color: initial;\">Packaging design for mobile devices. Inateck is a company from the United States that specializes in the production of various high-quality products related to electronics. It is particularly known for laptop cases and bags, barcode scanners, USB-C chargers, hard drive cases, docking stations, and more. In the studio we developed the design of the packaging template for mobile devices \"Inateck\", that are produced in China. Now all packaging of products supplied from factories in China will be decorated in the same corporate style. The packaging is minimalistic and informative, which allows you to attract the buyer and show the main characteristics of the product.</span></div>',''),(491,'491.jpg','2021-01-08 20:10:43.143619','2021-05-24 10:55:36.293104',115,1,1,'','Picture_1','','','',60,0,'','','','',''),(494,NULL,'2021-01-08 20:11:14.943440','2021-02-27 14:13:51.580494',114,1,1,'','Text','','','',61,0,'','','','Client: Yalida<br><br>Yalida is an industrial company that produces fastener products. We have developed an informative packaging template for their products, in accordance with which the future full-time designers of the company will develop a whole line of packaging for all the company\'s products. The package contains all the necessary information about the fastener, the type of thread, size, material and a graphic image of the product.',''),(495,'495.jpg','2021-01-08 20:11:14.947721','2021-05-24 10:56:18.128795',115,1,1,'','Picture_1','','','',61,0,'','','','',''),(498,NULL,'2021-01-08 20:11:47.200918','2021-03-04 16:31:29.667134',114,1,1,'','Text','','','',62,0,'','','','Illustration for musical toys of the brand Lucy&amp;Leo, Spain. <br><br>Macho cats decided to attract the attention of the lady of their heart and decided to perform a serenade under the window. Guitar chords and the rustle of maracas certainly interested the young senorita and she went out on the balcony to listen to pleasant melodies this evening. The illustration was created specifically for the decoration of the guitar body, but during the production process, the client liked the result so much that we were asked to reformat the \"Singing Cats\" for the decoration of the harmonica body. Now this funny illustration makes the guitar and harmonica even more attractive for young musicians!',''),(499,'499.jpg','2021-01-08 20:11:47.205648','2021-05-24 11:06:26.609581',115,1,1,'','Picture_1','','','',62,0,'','','','',''),(500,'500.jpg','2021-01-08 20:11:47.215366','2021-01-08 20:11:47.215394',116,1,1,'','Picture_2','','','',62,0,'','','','',''),(501,'501.jpg','2021-01-08 20:11:47.220925','2021-01-08 20:11:47.220949',117,1,1,'','Picture_3','','','',62,0,'','','','',''),(502,NULL,'2021-01-08 20:12:26.454022','2021-01-28 15:37:01.703900',1,1,1,'','Text','','','',63,0,'','','','<div>For the Spanish \"Lucy and Leo\" in our studio, we drew an illustration for a toy-xylophone.&nbsp;<span style=\"background-color: initial;\">The xylophone develops auditory perception, sense of rhythm and coordination.&nbsp;</span><span style=\"background-color: initial;\">The toy causes a positive emotional reaction because children love to create loud and pleasant sounds.<br><br></span><span style=\"background-color: initial;\">To differentiate the toys on the store shelves from other similar products we came up with an original story for illustration.&nbsp;</span><span style=\"background-color: initial;\">An unusual trio of birds floating on a crocodile down the Amazon river, playing jazz.<br><br></span><span style=\"background-color: initial;\">Such a funny illustration makes the xylophone even more attractive for young musicians!</span></div>',''),(503,'503.jpg','2021-01-08 20:12:26.459173','2021-01-16 15:46:07.946177',3,1,1,'','Picture_3','','','',63,0,'','','','',''),(504,'504.jpg','2021-01-08 20:12:26.465325','2021-01-08 21:38:48.280281',4,1,1,'','Picture_2','','','',63,0,'','','','',''),(506,NULL,'2021-01-08 20:12:58.046730','2021-01-28 16:10:14.540558',2,1,1,'','Text','','','',64,0,'','','','<div>Illustrations for our partner - marketing agency Market Entry Atelier.<br><br><span style=\"background-color: initial;\">Market Entry Atelier is a consulting service for foreign companies seeking to start or expand their business in China, Russia and Europe.<br><br></span><span style=\"background-color: initial;\">Story illustrations with infographics clearly show what tasks the agency solves and visualize the process of interaction with the client.&nbsp;</span><span style=\"background-color: initial;\">The illustrations perfectly complement the texts in the presentations and serve as visual content on the company\'s website.</span></div>',''),(507,'507.jpg','2021-01-08 20:12:58.051874','2021-01-16 15:48:29.760256',3,1,1,'','Picture_2','','','',64,0,'','','','',''),(508,'508.jpg','2021-01-08 20:12:58.058432','2021-05-24 11:07:24.624496',2,1,1,'','Picture_1','','','',64,0,'','','','',''),(509,'509.jpg','2021-01-08 20:12:58.065813','2021-01-08 20:12:58.065852',4,1,1,'','Picture_3','','','',64,0,'','','','',''),(510,NULL,'2021-01-08 20:13:40.204737','2021-06-02 17:40:04.563996',1,1,1,'','Text','您希望孩子感受到真正的比赛精神或与专业运动员一起训练吗？我们工作室为Vatos品牌的充气人物设计了运动员的图案。','','',65,0,'','LOGO设计,包装设计,插图设计,工业设计,品牌设计,上海设计公司,玩具设计,网站设计','充气玩具设计 - 儿童充气玩具设计 - 户外玩具设计','<div>Do you want your child to feel the spirit of real competitions or training with professional athletes?&nbsp;<span style=\"background-color: initial;\">In the studio, we created illustrations of athletes for the inflatable figures game of the Vatos brand.&nbsp;<br><br></span><span style=\"background-color: initial;\">Whether it\'s the summer season or any other time of the year, inflatable players are a great way to play and train, get active and improve your pitching skills. The Vatos brand has actively launched sales on the Amazon platform in the US, which is why we chose a style for illustrations similar to the American manga - comics that are so popular in the United States.<br><br></span><span style=\"background-color: initial;\">It is no coincidence that the choice of characters is an American football player and a Baseball player - players of the most popular sports in the United States. We are looking forward to the start of sales of our inflatable athletes on Amazon!</span></div>',''),(511,'511.jpg','2021-01-08 20:13:40.213610','2021-05-24 11:04:48.630130',3,1,1,'','Picture_5','','','',65,0,'','','','',''),(512,'512.jpg','2021-01-08 20:13:40.218778','2021-01-08 20:13:40.218798',4,1,1,'','Picture_2','','','',65,0,'','','','',''),(513,'513.jpg','2021-01-08 20:13:40.224110','2021-01-08 20:13:40.224140',5,1,1,'','Picture_3','','','',65,0,'','','','',''),(514,NULL,'2021-01-08 20:14:19.609441','2021-01-28 16:23:11.875635',1,1,1,'','Text','','','',66,0,'','','','<div>Who said that dinosaurs disappeared from the planet Earth?&nbsp;<span style=\"background-color: initial;\">They didn\'t disappear!&nbsp;</span><span style=\"background-color: initial;\">They just hid, the \"Dinosaurs\" tent is a way to get into their world - the Jurassic world!&nbsp;</span><span style=\"background-color: initial;\">What adventures await its little owner?&nbsp;</span><span style=\"background-color: initial;\">What if he decides to ride a tyrannosaurus, or make friends with a giant triceratops?&nbsp;</span><span style=\"background-color: initial;\">Or would the pterodactyls invite him to go on a long journey, where a hot volcano lurks behind the horizon?&nbsp;<br><br></span><span style=\"background-color: initial;\">We have drawn a whole world of dinosaurs for your child and now playing in the tent with dinosaurs is even more interesting.</span></div>',''),(515,'515.jpg','2021-01-08 20:14:19.614257','2021-01-16 15:44:17.512244',7,1,1,'','Picture_7','','','',66,0,'','','','',''),(516,'516.jpg','2021-01-08 20:14:19.620538','2021-01-08 20:14:19.620573',3,1,1,'','Picture_2','','','',66,0,'','','','',''),(517,'517.jpg','2021-01-08 20:14:19.626670','2021-01-08 20:14:19.626694',4,1,1,'','Picture_3','','','',66,0,'','','','',''),(518,NULL,'2021-01-08 20:14:54.984955','2021-01-28 16:25:22.665644',1,1,1,'','Text','','','',67,0,'','','','<div>We created these original illustrations specifically for the Obro Toys brand.&nbsp;<span style=\"background-color: initial;\">Safari adventures begin!<br><br></span><span style=\"background-color: initial;\">Arrange 6 different animals with the cubes - a Lion on the beach, an Elephant - circus strongman, a Crocodile - gardener, a Hippo - swimmer, a Zebra - artist and a Giraffe - tennis player.&nbsp;<br><br></span><span style=\"background-color: initial;\">In each illustration, we have given the character human properties and now the child, having arranged the picture, can come up with a story about their hero.<br><br></span><span style=\"background-color: initial;\">This is much more fun and interesting than looking at and arrange ordinary animals, so the toy is very popular with small safari explorers.</span></div>',''),(519,'519.jpg','2021-01-08 20:14:54.990349','2021-01-16 15:49:05.414311',8,1,1,'','Picture_7','','','',67,0,'','','','',''),(520,'520.jpg','2021-01-08 20:14:55.001147','2021-01-08 20:14:55.001178',3,1,1,'','Picture_2','','','',67,0,'','','','',''),(521,'521.jpg','2021-01-08 20:14:55.007246','2021-01-08 20:14:55.007272',4,1,1,'','Picture_3','','','',67,0,'','','','',''),(522,'522.jpg','2021-01-08 20:24:50.00079