;',''),(656,NULL,'2021-04-21 10:54:05.421343','2021-04-21 14:18:18.046627',114,1,1,'','Text','','','',79,0,'','','','<div>Client: Bomik toys<br><br><span style=\"background-color: initial;\">Bomik is a brand of educational toys made of EVA (foamed vinyl acetate) and wood parts, which are popular in the middle and low price market segment. To attract young customers and update the brand image we were asked to develop and come up with characters for a cartoon and toys based on it. After working through a lot of ideas and options, we created a bright logo and cute characters for a cartoon about friendly aliens. Bomiks are cute aliens who are friends with children and help them in difficult situations. They arrive on their flying saucer when parents are very busy with important things and cant help children in solving problems. For every character - Bomik, Ollie, Milo and Inky - we have developed a unique personality and hobbies. They also have a friend on our planet Earth - a boy named Mike. Together with these funny characters, your children will have an unforgettable fantastic adventure!</span></div>',''),(657,'657.jpg','2021-04-21 10:54:05.428966','2021-06-01 13:06:40.718561',115,1,1,'','Picture_1','','','',79,0,'','','','',''),(658,'658.jpg','2021-04-21 10:54:05.443731','2021-04-21 10:54:05.443781',116,1,1,'','Picture_2','','','',79,0,'','','','',''),(659,'659.jpg','2021-04-21 10:54:05.449631','2021-04-21 10:54:05.449649',117,1,1,'','Picture_3','','','',79,0,'','','','',''),(660,'660.jpg','2021-04-21 10:55:34.611215','2021-04-21 10:55:34.611240',272,1,1,'','Picture_4',NULL,NULL,NULL,79,0,NULL,NULL,NULL,NULL,NULL),(661,'661.jpg','2021-04-21 10:55:39.992433','2021-04-21 10:55:39.992461',273,1,1,'','Picture_5',NULL,NULL,NULL,79,0,NULL,NULL,NULL,NULL,NULL),(662,'662.jpg','2021-04-21 10:55:43.774842','2021-04-21 10:55:43.774869',274,1,1,'','Picture_6',NULL,NULL,NULL,79,0,NULL,NULL,NULL,NULL,NULL),(663,'663.jpg','2021-04-21 10:55:48.418834','2021-04-21 10:55:48.418858',2