:22:31.946608','2021-06-01 12:40:02.211153',305,1,1,'','Picture_4','','','',83,0,'','','','',''),(710,NULL,'2021-04-21 11:24:03.823270','2021-04-21 14:51:08.848692',114,1,1,'','Text','','','',84,0,'','','','<div>Client: Lucy and Leo<br><br><span style=\"background-color: initial;\">Lucy&amp;Leo toys is a Spanish brand that develops and manufactures educational toys made of wood. Toys are successfully sold in Europe, Latin America and Russia. In 2020, the company began entering the Chinese market and offers customers high-quality wooden toys - wholesale and retail. To increase the brand\'s appeal and promote sales we were tasked with creating stylish packaging for toys, where the main subject would be the images of the toy, and not secondary graphic elements, as is often done by competitors from China with their packaging. The main task is to show the buyer a toy without unnecessary distractions. We have implemented only the most important graphic elements that have a functional load on the packaging while the main object remains the toy itself.</span></div>',''),(711,'711.jpg','2021-04-21 11:24:03.830068','2021-05-24 10:55:58.913215',115,1,1,'','Picture_1','','','',84,0,'','','','',''),(712,'712.jpg','2021-04-21 11:24:03.841174','2021-04-21 11:24:03.841240',116,1,1,'','Picture_2','','','',84,0,'','','','',''),(713,'713.jpg','2021-04-21 11:24:03.850170','2021-04-21 11:24:03.850203',117,1,1,'','Picture_3','','','',84,0,'','','','',''),(714,'714.jpg','2021-04-21 11:24:42.583482','2021-04-21 11:24:42.583517',306,1,1,'','Picture_4',NULL,NULL,NULL,84,0,NULL,NULL,NULL,NULL,NULL),(715,'715.jpg','2021-04-21 11:24:45.741969','2021-04-21 11:24:45.741995',307,1,1,'','Picture_5',NULL,NULL,NULL,84,0,NULL,NULL,NULL,NULL,NULL),(716,'716.jpg','2021-04-21 11:24:49.443570','2021-04-21 11:24:52.237706',308,1,1,'','Picture_6','','','',84,0,'','','','',''),(717,'717.jpg','2021-04-21 11:24:56.485932','2021-04-21 11:24:56.485962',309,1,1,'','Picture_7',NULL,NULL,NULL,84,0,NULL,NULL,NULL,NULL,NULL),(718,NULL,'2021-04-21 11:26:12.930999','2021-04-21 14:06:42.354061',114,1,1,'','Text','','','',85,0,'','','','<div>Client: Bai Xiang Media Co., Ltd., China, Shangrao city.&nbsp;<br><br><span style=\"background-color: initial;\">Bai Xiang Media - 100 ways to place your ads on various structures in the busiest places of the city. In the studio, we came up with an original and memorable logo for the Bai advertising company. Indeed, a company that can place your ads even on the clouds needed just that kind of a creative sign. Inspired by the advertising signs of the largest megacities, we took the number 100 from the company name as a basis and stylized the shape of the logo as a cloud, additionally making the font contours closed like neon signs.</span></div>',''),(719,'719.jpg','2021-04-21 11:26:12.936730','2021-05-24 10:10:45.996813',115,1,1,'','Picture_1','','','',85,0,'','','','',''),(720,'720.jpg','2021-04-21 11:26:12.945848','2021-04-21 11:26:12.945941',116,1,1,'','Picture_2','','','',85,0,'','','','',''),(721,'721.jpg','2021-04-21 11:26:12.953440','2021-04-21 11:26:12.953473',117,1,1,'','Picture_3','','','',85,0,'','','','',''),(722,NULL,'2021-04-21 11:27:58.472575','2021-04-21 14:57:34.039994',114,1,1,'','Text','','','',86,0,'','','','<div>Client: Big Wolf LLC, Beijing.<br><br><span style=\"background-color: initial;\">Under the brand name \"Big Wolf\", a team of like-minded people from Beijing creates and produces educational toys and board games that promote intellectual, mental and general development of children. In connection with the entry into the European and American markets and the launch of sales on the Amazon platform, the company needed a logo, corporate identity, packaging design and a brand concept. In the studio, we analyzed and identified the main advantages of the brand over similar brands and identified the main principles of brand development. Based on the research we described the brand\'s mission and created a legend in the form o