an educational book and made unusual illustrations. Lucy is an active and inquisitive girl, and Leo is her friend, who is different in that he constantly comes up with different ideas for adventures. They travel around the world in a red balloon and learn a lot of interesting things about the world. Are you ready to go on an adventure with Lucy and Leo? If so, then you will meet new friends and countries on different continents, you will get acquainted with the culture, geography, animals, and even with the dragon, find out why a little kangaroo can not be a football player, come up with new names for new friends and interesting places on our planet...</span></div>',''),(761,'761.jpg','2021-04-26 11:11:54.589771','2021-05-24 11:06:04.567328',115,1,1,'','Picture_1','','','',89,0,'','','','',''),(762,'762.jpg','2021-04-26 11:11:54.600522','2021-04-26 11:11:54.600568',116,1,1,'','Picture_2','','','',89,0,'','','','',''),(763,'763.jpg','2021-04-26 11:11:54.610849','2021-04-26 11:11:54.610892',117,1,1,'','Picture_3','','','',89,0,'','','','',''),(764,'764.jpg','2021-04-26 11:12:16.633053','2021-04-26 11:12:16.633080',334,1,1,'','Picture_4',NULL,NULL,NULL,89,0,NULL,NULL,NULL,NULL,NULL),(765,'765.jpg','2021-04-26 11:12:21.108878','2021-04-26 11:12:21.108903',335,1,1,'','Picture_5',NULL,NULL,NULL,89,0,NULL,NULL,NULL,NULL,NULL),(766,'766.jpg','2021-04-26 11:12:24.951213','2021-04-26 11:12:24.951235',336,1,1,'','Picture_6',NULL,NULL,NULL,89,0,NULL,NULL,NULL,NULL,NULL),(767,'767.jpg','2021-04-26 11:12:29.374361','2021-04-26 11:12:29.374398',337,1,1,'','Picture_7',NULL,NULL,NULL,89,0,NULL,NULL,NULL,NULL,NULL),(768,'768.jpg','2021-04-26 11:12:33.420880','2021-04-26 11:12:33.420907',338,1,1,'','Picture_8',NULL,NULL,NULL,89,0,NULL,NULL,NULL,NULL,NULL),(769,'769.jpg','2021-04-26 11:12:37.207726','2021-04-26 11:12:37.207746',339,1,1,'','Picture_9',NULL,NULL,NULL,89,0,NULL,NULL,NULL,NULL,NULL),(770,'770.jpg','2021-04-26 11:12:41.225138','2021-04-26 11:12:41.225164',340,1,1,'','Pictur