INSERT INTO `languages_translate` VALUES (1,NULL,'2020-12-21 13:59:26.363174','2020-12-21 13:59:26.363195',1,1,NULL,NULL,1,'flatcontent.blocks',32,'html','<div><b>Infinity Ink 带你走进无穷无尽的创意空间。</b></div><div>我们是一家专业的设计工作室，对普通事物有着独到的看法。<br>在这里，我们一起探索设计的奥秘。<br>助您拔类超群, 脱颖而出的设计!<br><br></div><div>自2015年以来，Infinity Ink 用优秀的设计案例帮助客户解决各类需求。 <br><b>不夸大其词，只走成功之道。</b></div>',''),(2,NULL,'2020-12-21 14:05:17.530817','2020-12-21 14:05:17.530854',2,1,NULL,NULL,1,'flatcontent.blocks',12,'name','首页',''),(3,NULL,'2020-12-21 14:25:41.508956','2020-12-21 14:25:41.509036',3,1,NULL,NULL,1,'flatcontent.blocks',29,'name','我们的团队',''),(4,NULL,'2020-12-23 11:42:23.440266','2020-12-23 11:42:23.440301',4,1,NULL,NULL,1,'flatcontent.blocks',13,'name','设计案例',''),(5,NULL,'2020-12-23 11:43:45.817931','2020-12-23 11:43:45.817968',5,1,NULL,NULL,1,'flatcontent.blocks',14,'name','视觉设计',''),(6,NULL,'2020-12-23 11:49:02.892075','2020-12-23 11:49:02.892094',6,1,NULL,NULL,1,'flatcontent.blocks',15,'name','插图设计',''),(7,NULL,'2020-12-23 11:49:49.939493','2020-12-23 11:49:49.939535',7,1,NULL,NULL,1,'flatcontent.blocks',16,'name','玩具设计',''),(8,NULL,'2020-12-23 11:51:44.277698','2020-12-23 11:51:44.277765',8,1,NULL,NULL,1,'flatcontent.blocks',17,'name','工业设计',''),(9,NULL,'2020-12-23 11:55:06.927691','2020-12-23 11:55:06.927731',9,1,NULL,NULL,1,'flatcontent.blocks',196,'name','包装设计',''),(10,NULL,'2020-12-23 11:56:08.562212','2020-12-23 11:56:08.562258',10,1,NULL,NULL,1,'flatcontent.blocks',197,'name','网页设计',''),(11,NULL,'2020-12-23 11:56:58.094811','2020-12-23 11:56:58.094831',11,1,NULL,NULL,1,'flatcontent.blocks',18,'name','服务项目',''),(12,NULL,'2020-12-23 11:57:12.230110','2020-12-23 11:57:12.230139',12,1,NULL,NULL,1,'flatcontent.blocks',19,'name','设计申请表格',''),(13,NULL,'2020-12-23 11:57:26.531971','2020-12-23 11:57:26.532003',13,1,NULL,NULL,1,'flatcontent.blocks',20,'name','联系方式',''),(14,NULL,'2020-12-23 12:01:32.449767','2020-12-23 12:01:32.449793',14,1,NULL,NULL,1,'flatcontent.blocks',13,'description','我们的作品',''),(15,NULL,'2020-12-23 12:02:38.037019','2020-12-23 12:02:38.037048',15,1,NULL,NULL,1,'flatcontent.blocks',13,'html','如果有什么问题，请随时联系我们<br>',''),(16,NULL,'2020-12-23 12:12:31.686743','2020-12-23 12:12:31.686782',16,1,NULL,NULL,1,'flatcontent.blocks',155,'description','设计师 | 插画师 | 创意总监',''),(17,NULL,'2020-12-23 12:14:08.198589','2020-12-23 12:14:08.198613',17,1,NULL,NULL,1,'flatcontent.blocks',155,'html','','		\r\n	\r\n	\r\n		<div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p></p><div>\"在西班牙、中国和俄罗斯有9年以上的设计和国际艺术项目经验。我喜欢任何类型的设计，善于将原始思想与热情和奉献精神相结合。我有一个小诀窍，可以达到期望的效果 - 折衷主义，加上独到的见解以及我对工作的<span style=\"background-color: initial;\">热爱\"。&nbsp;</span></div><p></p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>'),(18,NULL,'2020-12-23 12:15:05.867923','2020-12-23 12:15:05.867952',18,1,NULL,NULL,1,'flatcontent.blocks',156,'description','工业设计师 | 创意工程师',''),(19,NULL,'2020-12-23 12:18:09.656417','2020-12-23 12:18:09.656459',19,1,NULL,NULL,1,'flatcontent.blocks',156,'html','<div>\"我在设计方面的经验主要致力于工业产品（机器人，工业产品，玩具...）和数字产品（网站，移动应用程序）的研究。</div><div>我喜欢所有类型的任务，无论是项目的完整设计还是在项目开发过程中的特定阶段提供及时的支持\"。</div>',''),(20,NULL,'2020-12-23 12:20:38.574693','2020-12-23 12:20:38.574731',20,1,NULL,NULL,1,'flatcontent.blocks',157,'html','\"我有超过7年的国外设计项目管理经验。精通汉语、了解中华文化，独具审美能力，所以我可以为中国客户提供最佳服务。 擅长于印刷项目、工业分析、玩具设计、以及市场建立品牌方面。让您的设计梦想成真，是我的使命\"。&nbsp;',''),(21,NULL,'2020-12-23 12:20:57.522004','2020-12-23 12:20:57.522034',21,1,NULL,NULL,1,'flatcontent.blocks',157,'description','项目管理 | 设计总监',''),(22,NULL,'2020-12-23 12:42:51.174959','2020-12-23 12:42:51.175007',22,1,NULL,NULL,1,'flatcontent.containers',12,'description','我们的团队<br>',''),(23,NULL,'2020-12-23 12:54:39.353425','2020-12-23 12:54:39.353466',23,1,NULL,NULL,1,'flatcontent.containers',13,'description','我们的团队',''),(24,NULL,'2020-12-23 12:55:31.693729','2020-12-23 12:55:31.693752',24,1,NULL,NULL,1,'flatcontent.containers',16,'description','合作伙伴',''),(25,NULL,'2020-12-23 12:56:07.907172','2020-12-23 12:56:07.907221',25,1,NULL,NULL,1,'flatcontent.containers',11,'description','服务项目',''),(26,NULL,'2020-12-23 12:56:34.988095','2020-12-23 12:56:34.988135',26,1,NULL,NULL,1,'flatcontent.containers',9,'description','设计案例',''),(27,NULL,'2020-12-23 12:58:23.231545','2020-12-23 12:58:23.231581',27,1,NULL,NULL,1,'flatcontent.blocks',146,'name','视觉',''),(28,NULL,'2020-12-23 13:04:01.276048','2020-12-23 13:04:01.276090',28,1,NULL,NULL,1,'flatcontent.blocks',146,'html','<div>视觉设计是一项复杂的任务，正确的方案能够促成品牌或公司良好的“脸面”。企业形象是企业与目标群通过视觉元素的互动与交流。<br><br>我们综合考虑企业风格色调、字体和图形在不同条件下&nbsp;<span style=\"background-color: initial;\">(室内和室外，光线明亮和昏暗)，以及在不同媒介(海报和小型名片等)上的外观效果。</span></div>',''),(29,NULL,'2020-12-23 13:06:18.603771','2020-12-23 13:06:18.603800',29,1,NULL,NULL,1,'flatcontent.blocks',147,'name','玩具设计',''),(30,NULL,'2020-12-23 13:06:18.610741','2020-12-23 13:06:18.610775',30,1,NULL,NULL,1,'flatcontent.blocks',147,'html','<div>我们将自己童年所学习到的知识，运用到玩具设计上，并做出新颖且具有教育意义的玩具。我们的玩具会让孩子以简单的游戏方式不停地学习开发自己的智力，寓教于乐!&nbsp;</div><div>我们认为，玩具应该为孩子们提供教育价值，同时为游戏带来乐趣。我们的团队是一些完全投身致力于玩具创造的人，尽管他们已经成人，但仍然保留那颗童心。我们每个人都试图体验游戏过程，并为其注入新鲜血液，带来一些我们认为有益的东西。</div>',''),(31,NULL,'2020-12-23 13:15:27.536303','2020-12-23 13:15:27.536329',31,1,NULL,NULL,1,'flatcontent.blocks',148,'name','插图',''),(32,NULL,'2020-12-23 13:15:27.541796','2020-12-23 13:15:27.541813',32,1,NULL,NULL,1,'flatcontent.blocks',148,'html','插图能使枯燥无味的商业文案和幻灯片变得生动形象。用明亮鲜艳的图像修饰广告和商品，令人印象深刻、过目不忘。当人们拿起书本、包装或玩具时，绝大多数人会先注意到插图，因为漂亮的视觉图像会激起人们强烈的情感反应。',''),(33,NULL,'2020-12-23 13:17:14.316150','2020-12-23 13:17:14.316184',33,1,NULL,NULL,1,'flatcontent.blocks',149,'name','工业设计',''),(34,NULL,'2020-12-23 13:17:14.323437','2020-12-23 13:17:14.323457',34,1,NULL,NULL,1,'flatcontent.blocks',149,'html','产品必须具有竞争力和吸引力。如何生产满足这些条件的产品呢? 产品设计、产品改进和商业成功离不开工业设计这一重要部分。在当今市场如果没有协调的、实用的设计，就意味着丧失了竞争力。我们为大众消费品、玩具和电子设备等产品提供最新、最切合实际的设计。',''),(35,NULL,'2020-12-23 13:20:17.209809','2020-12-23 13:20:17.209853',35,1,NULL,NULL,1,'flatcontent.blocks',150,'name','包装设计',''),(36,NULL,'2020-12-23 13:20:17.221980','2020-12-23 13:20:17.222014',36,1,NULL,NULL,1,'flatcontent.blocks',150,'html','当代市场的显著特征是竞争异常激烈。在这种市场情况下，仅仅依靠产品本身的优质是不够的。正确地向潜在消费者展示与介绍更为重要。一个令人过目不忘的包装设计有助于解决此问题。能给人留下深刻印象的产品包装设计会引起消费者的关注与兴趣，而有效的设计方案能促使消费者购买。',''),(37,NULL,'2020-12-23 13:22:44.941101','2020-12-23 13:22:44.941128',37,1,NULL,NULL,1,'flatcontent.blocks',151,'name','网页设计',''),(38,NULL,'2020-12-23 13:22:44.950732','2020-12-23 13:22:44.950752',38,1,NULL,NULL,1,'flatcontent.blocks',151,'html','<div>网络形象是当代世界中最重要的业务引擎。结构化的信息使您能够正确、顺利开展工作以吸引新客户，并维持与现有客户的稳定合作。</div><div>UI / UX、网站模板、网店、广告。</div>',''),(39,NULL,'2020-12-23 13:40:47.789081','2020-12-23 13:40:47.789104',39,1,NULL,NULL,1,'flatcontent.blocks',135,'name','插图',''),(40,NULL,'2020-12-23 13:41:56.851821','2020-12-23 13:41:56.851847',40,1,NULL,NULL,1,'flatcontent.blocks',146,'description','查看更多',''),(41,NULL,'2020-12-23 13:57:06.210385','2020-12-23 13:57:06.210431',41,1,NULL,NULL,1,'flatcontent.blocks',105,'name','视觉',''),(42,NULL,'2020-12-23 13:57:12.259932','2020-12-23 13:57:12.259950',42,1,NULL,NULL,1,'flatcontent.blocks',136,'name','玩具设计',''),(43,NULL,'2020-12-23 13:57:16.988886','2020-12-23 13:57:16.988908',43,1,NULL,NULL,1,'flatcontent.blocks',137,'name','工业设计',''),(44,NULL,'2020-12-23 13:57:23.540991','2020-12-23 13:57:23.541020',44,1,NULL,NULL,1,'flatcontent.blocks',138,'name','包装设计',''),(45,NULL,'2020-12-23 13:57:28.641379','2020-12-23 13:57:28.641400',45,1,NULL,NULL,1,'flatcontent.blocks',139,'name','网页设计',''),(46,NULL,'2020-12-23 13:59:27.104940','2020-12-23 13:59:27.104969',46,1,NULL,NULL,1,'flatcontent.blocks',3,'name','中国大陆',''),(47,NULL,'2020-12-23 13:59:27.109853','2020-12-23 13:59:27.109870',47,1,NULL,NULL,1,'flatcontent.blocks',3,'html','中国大陆<br>+86 134 29 020002<br>上海市静安区华山路328号氪空间225室<br>邮编：200040;\r\n',''),(48,NULL,'2020-12-23 14:09:51.418451','2020-12-23 14:09:51.418504',48,1,NULL,NULL,1,'flatcontent.blocks',191,'name','俄罗斯',''),(49,NULL,'2020-12-23 14:09:51.424833','2020-12-23 14:09:51.424862',49,1,NULL,NULL,1,'flatcontent.blocks',191,'html','俄罗斯<br>+7 922 1