,1,'flatcontent.blocks',582,'description','设计师 | 插画师 | 创意总监',''),(309,NULL,'2021-01-24 18:36:45.766797','2021-01-24 18:36:45.766829',309,1,NULL,NULL,1,'flatcontent.blocks',155,'title','多了解我们',''),(310,NULL,'2021-01-24 18:38:51.456081','2021-01-24 18:38:51.456105',310,1,NULL,NULL,1,'flatcontent.containers',72,'description','生活点滴',''),(311,NULL,'2021-01-24 18:38:54.672498','2021-01-24 18:38:54.672529',311,1,NULL,NULL,1,'flatcontent.containers',72,'name','生活点滴',''),(312,NULL,'2021-01-28 14:22:19.643808','2021-01-28 14:22:19.643839',312,1,NULL,NULL,1,'flatcontent.blocks',260,'html','这个方案是为纯意大利技术木制玩具制造商而设计的Logo和名称。在意大利，制作木制玩具的奥秘世代传承，是真正的传家宝。<br><br>因此，我们提出了“ Avito”这个名称，在意大利语中意为“世袭”。我们巧妙地利用了单词还找到了另一个意大利语谐音单词-Aviatore（意为飞行员），并决定将这些元素全部组合成一个完整的视觉形象。<br><br>复古风格的飞机和柔软的玩具-驾驶飞机的飞行员，这些能够唤起童年的回忆，温暖而精致的色彩着重渲染了这一点。准备完毕，立即起飞！',''),(313,NULL,'2021-01-28 14:27:15.620451','2021-01-28 14:27:15.620488',313,1,NULL,NULL,1,'flatcontent.blocks',271,'html','栗树贸易代理公司是一个从事中国物流的年轻企业。在工作室里，我们创造出了一个出其不意、令人难忘的Logo。这个方案并不容易，但是我们最终还是想出了一个非同寻常的造型，摆脱了局面。<br><br>我们将集装箱的图像“叠加”在了栗子的轮廓上，并用文本模块制作了不对称的构图，从而获得了一个充满现代感的Logo。 <br><br>听起来很奇怪，但是奇怪的创意经常会带来意想不到的效果！',''),(314,NULL,'2021-01-28 15:15:24.676187','2021-01-28 15:15:24.676216',314,1,NULL,NULL,1,'flatcontent.blocks',398,'html','<div><span style=\"background-color: initial;\">为深圳C-tronics有限公司主打儿童产品、玩具、套装的新品牌设计的Logo。该品牌主要针对亚洲和北美市场。Logo采用儿童彩色积木（黄色和红色）作为主体。该品牌主要将在美国的亚马逊平台上广泛销售，因此，除了印刷版本之外，我们还制作了该Logo的网页版本，视觉效果在电脑屏幕或移动设备上十分醒目。</span></div>',''),(315,NULL,'2021-01-28 15:27:33.505520','2021-01-28 15:27:33.505556',315,1,NULL,NULL,1,'flatcontent.blocks',402,'html','','<div>MEA Marketing Atelier将来自世界各地的人们汇集在一起，以促进东西方之间的成功合作。该公司分享有关于在中国开展业务的实践经验和知识，帮助划分主要目标和阶段，并为业务发展和进入中国市场开发个性化解决方案。<br><br><span style=\"background-color: initial;\">我们为Marketing Atelier设计了带有红色标签的Logo。红色标签表示向全球客户提供的优质服务！庄重而明亮，结构平衡，营造出与公司国际地位，公司声誉和发展领域相符合的视觉沟通氛围。<br><br></span><span style=\"background-color: initial;\">此外，我们还创造出了三种语言版本的业务与办公文档模板，在强调公司形象的同时，促进公司与客户和合作伙伴的顺利沟通。</span></div>'),(316,NULL,'2021-01-28 15:33:34.644257','2021-01-28 15:33:34.644294',316,1,NULL,NULL,1,'flatcontent.blocks',502,'html','为西班牙玩具品牌“Lucy and Leo”，我们绘制了木琴玩具的插图。木琴能够帮助孩子发展听觉，培养节奏感和协调感。该玩具能够引起积极的情感反应，因为孩子们喜欢自己发出响亮而愉悦的声音。<br><br>为了在货架上将这款玩具与其他类似产品区分开来，我们为插图还构想出了一个精彩的原创故事：鸟儿三重唱演奏着爵士乐，在鳄鱼的身上沿着亚马逊河畅游。<br><br>这样有趣的插图使木琴对小音乐家更具吸引力！',''),(317,NULL,'2021-01-28 16:10:14.136133','2021-01-28 16:10:14.136169',317,1,NULL,NULL,1,'flatcontent.blocks',506,'html','为我们的合作伙伴 - 营销机构Market Entry Atelier设计的插图。<br><br>Market Entry Atelier是专为希望在中国，俄罗斯和欧洲开展或扩展业务的外国公司提供咨询服务服务公司。<br><br>专题信息图可以清晰、直观地展示本公司需解决的任务，演示与客户的互动过程。插图能够完美地补充幻灯片的文案，并充当公司网站上的视觉内容部分。',''),(318,NULL,'2021-01-28 16:18:52.856880','2021-01-28 16:18:52.856924',318,1,NULL,NULL,1,'flatcontent.blocks',510,'html','您希望孩子感受到真正的比赛精神或与专业运动员一起训练吗？我们工作室为Vatos品牌的充气人物设计了运动员的图案。<br><br>无论是夏季还是其他季节，充气人物都是玩耍和训练，活跃并完善自己的投球技巧的绝佳方式。Vatos品牌已经美国的亚马逊上广泛销售，这就是我们选择与美国漫画相似的插图样式的原因 - 符合美国市场的喜好。<br><br>人物的选择也并非偶然-这是美式足球运动员和棒球运动员-美国最受欢迎的运动项目运动员。期待着我们的充气运动员在亚马逊的热销！',''),(319,NULL,'2021-01-28 16:22:44.670328','2021-01-28 16:22:44.670369',319,1,NULL,NULL,1,'flatcontent.blocks',514,'html','谁说恐龙从地球上灭绝了？ 没有灭绝！ 它们只是藏起来了，恐龙帐篷就是进入侏罗纪世界的方式！ 帐篷的小主人需要经历怎么样的奇幻旅程呢？ 他会不会骑着霸王龙或是与巨型三角龙交朋友？ 还是翼手龙会邀请他，去一个远在在地平线后面的地方开启漫长的旅程呢？ <br><br>我们为您的孩子构建了整个精彩的恐龙世界，现在在帐篷里和恐龙一起玩耍更加有趣了。',''),(320,NULL,'2021-01-28 16:25:17.209767','2021-01-28 16:25:17.209805',320,1,NULL,NULL,1,'flatcontent.blocks',518,'html','我们特别为Obro Toys品牌的玩具设计了这些原创插图。野生动物园大冒险现在开始！<br><br>从积木中收集6种不同的动物-海滩上的狮子，马戏团的大象，园丁鳄鱼，游泳健将河马，艺术家斑马和网球运动员长颈鹿。<br><br>在每个图案中，我们将动物角色拟人化，孩子在拼出图案后可以创造出自己的小故事。这比普通的观察和收集动物有趣多了，这正是为什么玩具特别受小小野生动物世界探险家的喜爱。',''),(321,NULL,'2021-02-08 15:12:10.327722','2021-02-08 15:12:10.327752',321,1,NULL,NULL,1,'flatcontent.blocks',258,'name','视觉',''),(322,NULL,'2021-02-08 15:43:00.422644','2021-02-08 15:43:00.422672',322,1,NULL,NULL,1,'flatcontent.blocks',326,'html','AMANI戒指是一种保护装置，用户只需轻点一下即可呼叫帮助，简单动作不会引起不必要的注意。光滑的外观下隐藏了一个警报按钮，可在紧急情况下向联系人发送求救警报。开发这种产品的初衷是减少对LGBT群体的攻击和骚扰，并作为危险情况下男性、女性之间联系的纽带。',''),(323,NULL,'2021-02-08 15:45:35.906866','2021-02-08 15:45:35.906905',323,1,NULL,NULL,1,'flatcontent.blocks',430,'html','','儿童与成人都适用的精美设计。<br><br><span style=\"background-color: initial;\"><div>这款空气加湿器我们是专门为患有呼吸道疾病或皮肤干燥的婴幼儿设计的。<span style=\"background-color: initial;\">独特的可爱人形外观设计，更能引起孩子的喜爱。</span><span style=\"background-color: initial;\">建议摆放在卧室中，改善卧室空气坏境，利于作息和睡眠。其简约时尚的设计同样适用于家庭中任何位置，集使用功能与装饰功能于一身。</span></div></span>'),(324,NULL,'2021-02-08 15:47:03.119386','2021-02-08 15:47:03.119413',324,1,NULL,NULL,1,'flatcontent.blocks',434,'html','我们的目标是创造一个适合每个客厅的，时尚、优雅的路由器。我们与工程师携手合作，在精致漂亮的外观和经济实用的功能之间找到平衡，以确保稳定的强信号。特别要注意散热孔，散热孔是不可或缺的，并且经常成为设计的约束，会使产品看起来过于“技术化”。在这里，我们巧妙地将它们用作图形设计元素。设计结果充分证明了我们创新方案的可行性。',''),(325,NULL,'2021-02-08 15:48:53.661212','2021-02-08 15:48:53.661252',325,1,NULL,NULL,1,'flatcontent.blocks',442,'html','我们为旱冰，自行车和滑板等运动制作了儿童通用头部护具——头盔。我们对于头盔的通风问题进行了详尽的考虑，设计了通风孔，以便始终保证足够的新鲜空气，确保运动时的空气循环。气孔也是设计不可或缺的部分。头盔经过专业模型的打造，可为后颈部和耳朵周围提供额外的保护。我们还注重了头盔的图案设计。艳丽的色彩和闪电图案，对小小骑行运动员更具吸引力。',''),(326,NULL,'2021-02-08 15:59:06.016315','2021-02-08 15:59:06.016363',326,1,NULL,NULL,1,'flatcontent.blocks',438,'html','神奇的Tikino投影仪，适合对世界充满好奇的孩子们！ Tikino是一款专为儿童设计的视频投影仪，可投射教育性和互动性内容，让孩子远离平板电脑和智能手机，专心沉浸在充满友好和趣味的世界中玩乐、学习幻想、开创新世界。投影仪的形状类似于望远镜或古董相机，边缘呈圆形，便于儿童安全使用。可以将动画图像投射到任何光滑的浅色表面上，是儿童房的理想选择。',''),(327,NULL,'2021-02-08 17:13:49.306126','2021-02-08 17:13:49.306169',327,1,NULL,NULL,1,'flatcontent.blocks',446,'html','','<div><span style=\"background-color: initial;\">我们设计了一个简单便携的WiFi信号增强器，您可以将其安装在家里的任何地方。我们将信号增强器的形状定为三角形。为了使产品运行高效又符合人体工程学，在产品内部需容纳两个电子卡和三个天线，三角形是最紧凑、合适的形状。我们还特别注重了产品的感观：该产品旨在适合家庭或办公室中任何房间的风格，需要它尽可能不引人注目。因此，我们坚持简约风格，为其设别调制优雅的色彩和丰富的纹理，使其外观简约时尚。</span><br></div>'),(328,NULL,'2021-02-08 17:28:46.645610','2021-02-08 17:28:46.645642',328,1,NULL,NULL,1,'flatcontent.blocks',259,'name','玩具',''),(329,NULL,'2021-02-08 17:28:55.945454','2021-02-08 17:28:55.945485',329,1,NULL,NULL,1,'flatcontent.blocks',321,'name','工业',''),(330,NULL,'2021-02-08 17:29:07.637950','2021-02-08 17:29:07.637976',330,1,NULL,NULL,1,'flatcontent.blocks',331,'name','网站',''),(331,NULL,'2021-02-08 17:29:16.978344','2021-02-08 17:29:16.978371',331,1,NULL,NULL,1,'flatcontent.blocks',333,'name','包装',''),(332,NULL,'2021-02-08 17:29:27.057962','2021-02-08 17:29:27.057993',332,1,NULL,NULL,1,'flatcontent.blocks',334,'name','插画',''),(333,NULL,'2021-02-08 17:34:23.268714','2021-02-08 17:34:23.268745',333,1,NULL,NULL,1,'flatcontent.blocks',609,'html','法国<br>78 Rue Compans, 75019 Paris<br>info@infinityink.eu\r\n',''),(334,NULL,'2021-02-27 13:35:30.694987','2021-02-27 13:35:30.695010',334,1,NULL,NULL,1,'flatcontent.blocks',474,'html','','客户：Sisland Co. Ltd <br><br>怪物飞镖游戏的包装设计。 <br><br>与普通的飞镖游戏不同的是，在怪物飞镖中，除了通常的游戏区域外，还有一个额外的怪物区。您用飞镖击中不同的区域，可以获得数值不等的积分。得分最高的玩家将获胜。我们专门为游戏区域绘制了插图，并为游戏制作了带Logo的包装。在包装以及游戏区我们绘制了可爱的怪兽图案，这些怪兽能够吸引小玩家的注意力，并使游戏变得更加愉快、有趣。飞镖游戏将在美国和加拿大的亚马逊平台上出售，因此包装和游戏的插图风格最大程度地符合了北美买家的喜好。<br>'),(335,NULL,'2021-02-27 13:39:11.363334','2021-02-27 13:39:11.363358',335,1,NULL,NULL,1,'flatcontent.blocks',478,'html','','<div>客户：Beijing Hydrovita</div><div>含氢分子饮用水包装概念。</div><div>饮用含氢水是一种十分常见的疾病治疗方法。富氢水的概念来源于日本。 2013年，日本的市场规模达到2000亿日元。 Beijing Hydrovita克服了水中氢元素不溶性的困难，掌握了核心技术，并成为中国第一家生产富氢水的公司。</div><div>在设计方案中，我们以简约，整洁的样式设计了富氢水的包装，使其在药房的货架上和商店的柜台上看起来赏心悦目。水中的氢含量有所不同：1.1、1.8和2.0。为了使客户能在视觉上清楚区分这些数值，我们想出了利用从浅色到深色的颜色差异来区分产品包装。氢含量越高，包装的颜色越深，与此同时，包装看起来仍然清新舒适，并且内容丰富。</div>'),(336,NULL,'2021-02-27 13:48:24.539550','2021-02-27 13:48:24.539584',336,1,NULL,NULL,1,'flatcontent.blocks',482,'html','客户：Arman <br><br>我们为中国新疆的冰淇淋制造商设计了一款极具吸引力的产品包装。Kar Pari是Arman旗下的新疆本土品牌。Kar Pari的冰淇淋是这里特有的，不可错过的美味体验！它的特色是使用意大利甜点师傅的独家配方，搭配天然食材烹制而成。该系列有9种口味：巧克力、开心果、提拉米苏、榛子、奶油、草莓、香草、薄荷和天然浆果。我们为每种口味都设计了带有主要成分图案和不同的颜色代码的独立包装。包装的亮点是带有成分的小勺子，除此之外，冰淇淋的味道非常醇厚，仿佛是在吃整个浆果或坚果。<br>',''),(337,NULL,'2021-02-27 13:58:37.387900','2021-02-27 13:58:37.387922',337,1,NULL,NULL,1,'flatcontent.blocks',486,'html','','<div>客户：Arman</div><div>馒头包装。</div><div>我们专门为新疆当地市场设计了馒头包装。深夜，当整个乌鲁木齐都在沉睡时，阿尔曼工厂在准备美味的馒头，并在清晨将其送达各个商店。因此，阿尔曼的面包总是很新鲜。我们使用了欧洲面包店流行、常用图形样式来设计真空包装，使得烘焙食品能够保证全天的新鲜。这是一种带有手绘的甜点、羊角面包、法式长棍面包，麦穗等图形，结合用不同语言书写的各种烘焙食品名称的印刷图案。配色方案以单种明亮颜色为主，其他单色为辅，使包装达到一种温馨、家庭手工制作的视觉效果。为了使顾客能够充分观察产品的新鲜度，我们在包装上尽可能多的留出了透明的空间。因此，顾客永远都可以看到并确保这些美味烘焙食品的新鲜程度。</div>'),(338,NULL,'2021-02-27 14:03:31.597340','2021-02-27 14:03:31.597391',338,1,NULL,NULL,1,'flatcontent.blocks',490,'html','','<div>客户：INATECK<br><br><span style=\"background-color: initial;\">Inateck是一家专门生产各种高质量电子周边产品的美国公司。以笔记本电脑保护套和电脑包、条形码扫描仪，USB-C充电设备，硬盘机箱，充电底座等而闻名于行业。在设计方案中，我们为在中国生产的移动设备“ Inateck”开发了包装设计模板。现在，中国工厂生产的所有产品包装都将以一种同一种公司风格进行装饰。包装极简但内容丰富，可以吸引顾客并展示产品的主要特征。</span></div>'),(339,NULL,'2021-02-27 14:11:11.724974','2021-02-27 14:11:11.725016',339,1,NULL,NULL,1,'flatcontent.blocks',494,'html','<div>客户：Yalida<br><br><span style=\"background-color: initial;\">Yalida是一家专门生产紧固件的工业公司。我们已经为他们的产品开发了一个内容丰富的包装模板，根据该模板，该公司的内部设计师将会为公司的所有产品设置一整套包装流水线。 包装中含有关于紧固件、螺纹类型、尺寸、材料和产品图等所有必要信息。</span></div>',''),(340,NULL,'2021-02-27 14:21:19.662958','2021-02-27 14:21:19.662997',340,1,NULL,NULL,1,'flatcontent.blocks',264,'html','','<div>幼儿园儿童家具设计。<br><br><span style=\"background-color: initial;\">在这个特殊的订单中，我们为云和县的幼儿园设计了儿童家具。这套胶合板木桌和两把动物形状的椅子，我们绘制了柔和的彩色背景，孩子们可以在上面随意绘画和玩耍。这套家具可供两个孩子使用，幼儿园的一个班级最多可放置10套此家具。椅子和桌子的尺寸参数适合3至5岁的儿童。桌子长60厘米，高47厘米，椅子的高度为50厘米。桌子的中央有一塑料笔筒的特殊切口，可用于孩子们画笔的存放。乐高玩具架可伸缩，便于清洁和维护。椅背上有趣的动物图案会给孩子们留下深刻的印象。</span></div>'),(341,NULL,'2021-02-27 14:27:23.439938','2021-02-27 14:27:23.439968',341,1,NULL,NULL,1,'flatcontent.blocks',285,'html','','<div>客户：Lucy &amp; Leo</div><div>变形厨房玩具的工业设计</div><div>Lucy＆Leo是一个西班牙品牌，在中国设立了自己的工厂并生产儿童益智木制玩具。我们为小厨师们设计了这款胶合板可转换模块化厨房玩具。为了方便儿童或家长组装，我们提出了一种模块化紧固系统，使用大的塑料螺栓和螺母固定所有组装元件。这种方案还可以允许厨房玩具在扁平的包装中运输和销售。厨房玩具有多达3种转换形态！第一种是厨房造型，第二种是商店造型，第三种是绘图板造型。玩起来更加有趣！该套玩具还包含塑料与木制的厨房器皿，以便孩子完全模拟烹饪过程。</div>'),(342,NULL,'2021-02-27 14:35:10.995495','2021-02-27 14:35:10.995548',342,1,NULL,NULL,1,'flatcontent.blocks',414,'html','','<div>变形工作台玩具</div><div>客户：Lucy＆Leo</div><div>Lucy＆Leo是一个西班牙品牌，在中国设立了自己的工厂并生产儿童益智木制玩具。我们为小木匠们设计了这款胶合板可转换模块化的工作台玩具。为了方便儿童或家长组装，我们提出了一种模块化紧固系统，使用大的塑料螺栓和螺母固定所有组装元件。这种方案还可以允许工作台玩具在扁平的包装中运输和销售。工作台有2种转换形态！第一种是木匠工作台造型，第二种是绘图板造型。玩起来更加有趣！该套玩具还包含塑料与木制的不同功能的小工具，以便孩子完全模拟工匠操作，学习新的技能。</div>'),(343,NULL,'2021-02-27 14:41:48.096745','2021-02-27 14:41:48.096795',343,1,NULL,NULL,1,'flatcontent.blocks',418,'html','','<div>“森林之树”滑梯墙壁玩具的设计与插画。</div><div>客户：Lucy＆Leo</div><div><span style=\"background-color: initial;\">Lucy＆Leo是一个西班牙品牌，在中国设立了自己的工厂并生产儿童益智木制玩具。</span><span style=\"background-color: initial;\">我们专为Lucy＆Leo品牌设计了这种壁式玩具，可用于家庭或幼儿园。该玩具适合任何室内装饰。</span><span style=\"background-color: initial;\">“森林之树”滑梯是非常适合幼儿的独特玩具，与大多数其他玩具不同，它可直接安装在墙上！生动的插图描绘了生活在一棵大树上的各种可爱的森林动物。这棵树的树枝为滑梯，还有光滑的彩色木球，可以向下滚动。当球放在树枝的顶部时，它滚向树的根部，沿途滚动并撞击。该玩具非常适合喜欢移动物体，发展运动技能并学习色彩活泼的孩子们。我们选择了优质的木材和胶合板，设计了一个简单但结实稳定的结构，并创建了有趣的角色，能够保证孩子们长久的游戏乐趣！</span></div>'),(344,NULL,'2021-02-27 14:48:13.899883','2021-02-27 14:48:13.899909',344,1,NULL,NULL,1,'flatcontent.blocks',426,'html','','<div><span style=\"background-color: initial;\">敲击 台玩具玩具的设计和插图。<br><br>客户：Obro toys</span></div><div>Obro玩具是一个欧洲木制益智与教育玩具品牌。<span style=\"background-color: initial;\">在Obro玩具品牌的方案中，我们为2岁以下的儿童专门开发了一种敲击玩具。为了将玩具与其他竞争对手的同款区分开来，我们决定采用太空元素和玩具独特形状的想法。太空冒险开始了！小宇航员将执行一项激动人心的任务——在遥远的星球表面以外星人和小球的形式敲打明亮的木桩。机灵的孩子们将会特别喜欢这个玩具，我们特意将它做成了双面的。当所有木桩都敲落时，可以将玩具翻转过来，然后在另一个星球上继续游戏。游戏永远不会停止！</span></div>'),(345,NULL,'2021-02-27 14:50:30.395760','2021-02-27 14:50:30.395789',345,1,NULL,NULL,1,'flatcontent.blocks',422,'html','','<div>游泳池和喷泉的设计与插图。<br><span style=\"background-color: initial;\"><br>客户：Vatos</span></div><div><span style=\"background-color: initial;\">我们为Vatos品牌游泳池专门设计结构和插图。这个带喷泉的舒适小游泳池将会获得每个孩子的喜爱。两侧有小孔，水将缓缓流出，在炎热的夏日为大家降温，而在游泳池中央则有个真正的喷泉！为了使喷泉正常工作，需要一条有水压的常规软管，并将软管连接到游泳池的一个特殊孔上。设计方案并没有终止，我们还是为客户提供了一个生动有趣的游泳池插图。以太空为主题，并用飞碟和外星怪物组成了可爱的图案。孩子们来了就不想走！</span><br></div>'),(346,NULL,'2021-03-01 10:13:18.150783','2021-03-01 10:13:18.150821',346,1,NULL,NULL,1,'flatcontent.containers',20,'description','视觉',''),(347,NULL,'2021-03-01 10:15:45.672431','2021-03-01 10:15:45.672466',347,1,NULL,NULL,1,'flatcontent.containers',21,'name','插图',''),(348,NULL,'2021-03-01 10:15:45.688603','2021-03-01 10:15:45.688646',348,1,NULL,NULL,1,'flatcontent.containers',21,'description','插图',''),(349,NULL,'2021-03-01 10:16:58.905629','2021-03-01 10:16:58.905657',349,1,NULL,NULL,1,'flatcontent.containers',22,'name','玩具设计',''),(350,NULL,'2021-03-01 10:16:58.914433','2021-03-01 10:16:58.914517',350,1,NULL,NULL,1,'flatcontent.containers',22,'description','玩具设计',''),(351,NULL,'2021-03-01 10:46:02.818120','2021-03-01 10:46:02.818150',351,1,NULL,NULL,1,'flatcontent.blocks',450,'html','','客户：LSHBC<br>LSHBC website&nbsp;<br><a href=\"https://www.sh-leo.com/\">www.sh-leo.com</a><br><br>为一家中国商务咨询公司设计的网站。 该公司在中国提供商业与制造业领域的咨询服务，同时也包括展会组织、法律服务和商务会谈翻译等服务。公司的所有业务领域都同样重要，因此我们开发了一种强调其各业务等效性的设计。在服务列表中，所有内容均按方向分组，根据导航可以立即找到所需内容，非常方便。在每个板块中，客户都能检索找到必要的信息，同时可以留下需求，公司的反馈服务必将有求必应。网站设计采用商务风格，色彩简洁。为了使网站视觉效果更佳，我们选取了黑白效果的中国美景图作为背景，并将公司的业务实拍图添加到了页面上。<br>'),(352,NULL,'2021-03-01 10:51:22.563784','2021-03-01 10:51:22.563824',352,1,NULL,NULL,1,'flatcontent.blocks',454,'html','','客户：MotorData Professional<br><br>MotorData OBD <br><br>车辆诊断应用程序的小部件和界面设计。 MotorData OBD是一款Android系统应用程序，用于实时诊断和显示车辆情况与数据：读取和清除代码，读取冻结帧和当前数据。窗口小部件可帮助您在移动设备上的应用程序中显示有关汽车当前状态的所有必要信息。由于创建了模块化网格，我们为窗口小部件开发的3种图形样式，可被收集到一个模块中并同时跟踪汽车引擎性能，速度，油耗，变速箱温度等多个指标。所有数据都整合在直观的图表和刻度表中，使用一组特殊的对比色，方便您任何时间、任何移动设备上读取信息。'),(353,NULL,'2021-03-01 10:59:40.976167','2021-03-01 10:59:40.976202',353,1,NULL,NULL,1,'flatcontent.blocks',458,'html','','客户：Naviaddress <br><br>Naviaddress公司的图形与社交账户设计。 <br><br>Naviaddress是一个所有地方和物体的智能数字地址。它结合了有关位置的邮政地址，坐标等数字化、可搜索的数据。使用Naviaddress平台可轻松精准导航。 对于该公司，我们创建了用于社交平台的品牌化模板和图形，例如，facebook，linkedin，instagram等其他社交平台。社交平台的图形识别有助于快速有效地将必要的信息传达给客户。模板将帮助您轻松地将任何图形调整为品牌的整体风格，并帮助公司员工自动填充社交平台信息。 <br><br><a href=\"www.instagram.com/naviaddress/\">www.instagram.com/naviaddress/</a>'),(354,NULL,'2021-03-01 11:03:50.768648','2021-03-01 11:03:50.768676',354,1,NULL,NULL,1,'flatcontent.blocks',462,'html','','客户：Jumbo Toys<br><a href=\"https://infinityink.cn/flatcontent/admin/flatpages/tree/53/www.jumbo-toys.ru\">www.jumbo-toys.ru</a> <br><br>Jumbo Toys是儿童玩具，儿童自行车、滑板车和儿童体育用品的制造商和批发商。Jumbo Toys的客户包括批发和零售公司，网店和贸易商城以及俄罗斯大型连锁店铺。为了使买卖双方轻松管理大量不同产品，我们设计了一个多功能网络商店。我们特别重视购物车的设计。数以百计的不同产品将被添加于此，如有需要，可实现立即将这些产品分配给负责的工作人员。当采购者仅对某些类型的产品感兴趣，例如适合自行车商店的产品，可生成收藏列表。其中包含与搜索查询相符合的产品。该站点由公司员工维护。<br>'),(355,NULL,'2021-03-01 11:09:28.114965','2021-03-01 11:09:28.115006',355,1,NULL,NULL,1,'flatcontent.blocks',466,'html','','客户：Lucy&amp;Leo toys&nbsp;<br><br>Lucy＆Leo在线店铺 淘宝平台上的网店页面设计。<br><br>Lucy＆Leo玩具是一个设计和制造木质益智玩具的西班牙品牌。玩具已在欧洲，拉丁美洲和俄罗斯广泛销售。 2020年该公司进入中国市场，为消费者提供高质量的木质玩具批发与零售服务。对于在淘宝平台上的网店页面设计，我们同时兼顾了用于PC和移动设备的模板设计。在设计方案中，我们使用了品牌图形与插图。产品页面是由该公司员工使用我们创建的模板所形成的，我们还制作了用于新产品宣传的广告横幅和公司营销活动的模板。'),(356,NULL,'2021-03-01 11:19:35.707414','2021-03-01 11:19:35.707456',356,1,NULL,NULL,1,'flatcontent.blocks',470,'html','','客户：Obro toys <br><br>淘宝平台上的网店页面设计。 <br><br>Obro玩具是一个设计和制造木质益智玩具的欧洲新兴品牌， 已成功在欧洲和俄罗斯销售。现在，该公司正在致力进入中国市场，因此，选择从中国最大最知名的淘宝平台，向我们求助，以设计公司的网店页面。我们为该公司开发了用于PC和移动设备的页面模板设计。在设计方案中，我们使用了品牌图形和插图。产品页面是由该公司员工使用我们创建的模板所形成的，我们还制作了用于新产品宣传的广告横幅和公司营销活动的模板。希望Obro玩具能够顺利打开中国市场并取得良好的销售业绩！'),(357,NULL,'2021-03-04 16:31:29.339194','2021-03-04 16:31:29.339227',357,1,NULL,NULL,1,'flatcontent.blocks',498,'html','为西班牙玩具品牌Lucy&amp;Leo的音乐类玩具设计的插图。<br><br>健壮的猫先生们想要吸引心仪女士的注意力，于是决定在窗下弹奏小夜曲。吉他弦和马拉卡斯的沙沙声确实让年轻的女士感兴趣，于是在这个迷人的夜晚她走到阳台，仔细聆听着悦耳的旋律。该插图是专为装饰吉他琴体而设计的，在方案设计过程中，客户非常喜欢这个方案，请求我们再创造出“演唱的猫咪”作为口琴的插图。现在，这些有趣的插图让吉他和口琴玩具更加吸引小小艺术家的注意力！',''),(358,NULL,'2021-03-15 09:44:21.358840','2021-03-15 09:44:21.358863',358,1,NULL,NULL,1,'flatcontent.blocks',611,'html','','<div>我有十年以上web应用程序，CRM、CMS系统开发经验。<span style=\"background-color: initial;\">熟练掌握python编程，了解java，golang，php。主要负责网站布局，前端开发 - javascript / css / html，react。了解VOIP电话，有devops开发的工作经验。</span><span style=\"background-color: initial;\">我乐于挑战最困难的任务，喜欢创新、非同寻常的网站开发。</span></div>'),(359,NULL,'2021-03-15 09:44:35.980778','2021-03-15 09:44:35.980833',359,1,NULL,NULL,1,'flatcontent.blocks',611,'description','高级程序员 | 开发工程师',''),(360,NULL,'2021-03-31 13:53:14.743971','2021-03-31 13:53:14