04-21 14:57:33.059201','2021-04-21 14:57:33.059250',392,1,NULL,NULL,1,'flatcontent.blocks',722,'html','','<div>客户：大狼品牌，北京<br><br><span style=\"background-color: initial;\">一群来自北京志同道合的人设计并制造了益智玩具和棋盘游戏——“大狼”品牌，这些玩具和游戏有助于儿童的智力与身体机能的整体发展。由于品牌已经打入欧美市场并在亚马逊平台上展开销售，该公司需要logo，企业主题，包装设计和品牌形象的设计。在工作室里，我们对该品牌相比于其它同类品牌的主要优势进行了分析，并确定了品牌发展的主要原则。基于分析结果，我们创造了品牌的使命，并以童话形式讲述了大狼的故事。下一阶段，我们的团队着重于体现品牌的视觉效果。我们用孩子们喜欢的大狼学者的形象创造了一个十分富有吸引力的logo，并创造了用于设计品牌周边产品和包装的图形元素。为了有效利用公司图形的所有元素，我们创建了一个使用指南，其中包含所有元素和布局的使用范例。</span></div>'),(393,NULL,'2021-04-21 14:58:20.656040','2021-04-21 14:58:20.656115',393,1,NULL,NULL,1,'flatcontent.containers',86,'name','大狼教育玩具品牌VI设计',''),(394,NULL,'2021-04-21 14:58:20.667116','2021-04-21 14:58:20.667140',394,1,NULL,NULL,1,'flatcontent.containers',86,'description','大狼教育玩具品牌VI设计',''),(395,NULL,'2021-04-21 14:59:49.148673','2021-04-21 14:59:49.148700',395,1,NULL,NULL,1,'flatcontent.blocks',750,'html','<div><span style=\"background-color: initial;\">我们支持足球的发展，并为想要参与到这项世界最受欢迎的运动，但没有机会的孩子创造条件。 新疆有很多有天赋与才华的运动员，但他们没有可供培训与发展的基训俱乐部，我们工作室决定以此为出发点，为乌鲁木齐FC设计了logo，并为球员设计了赛服与徽标。 我们希望通过这种方式，能够引起大家对该地区足球发展的关注与重视。</span></div>',''),(396,NULL,'2021-04-21 15:01:13.988477','2021-04-21 15:01:13.988518',396,1,NULL,NULL,1,'flatcontent.containers',88,'name','乌鲁木齐足球队 Logo 概念设计',''),(397,NULL,'2021-04-21 15:01:13.996202','2021-04-21 15:01:13.996233',397,1,NULL,NULL,1,'flatcontent.containers',88,'description','乌鲁木齐足球队 Logo 概念设计',''),(398,NULL,'2021-04-21 15:02:58.828822','2021-04-21 15:02:58.828847',398,1,NULL,NULL,1,'flatcontent.blocks',738,'html','','<div>客户：乌拉尔火车（俄罗斯联邦斯维尔德洛夫斯克州上佩什马市），锡那拉集团与西门子的合资企业。<br><br><span style=\"background-color: initial;\">乌拉尔火车的主要业务方向是设计、生产、销售和维护新一代牵引机车，其特点是效率大幅提高，在节省成本的前提下满足高水准的消费与运营需求。2020年是企业成立10周年纪念。我们工作室为企业十周年设计了主题logo，并为十周年纪念设计了独特的企业主题风格。除标准的纪念品外，我们还设计了一系列由水彩画家绘制的明信片，采用俄罗斯大自然为背景，火车为主图。除此之外，还制作了带有公司10年成就图表的海报。所有周边产品都得到了客户的一致好评。此次周年活动最重要的是——在我们设计的周年文化衫中凸显新火车。 10周年-开始新征途！</span></div>'),(399,NULL,'2021-04-21 15:03:57.914817','2021-04-21 15:03:57.914858',399,1,