17 14:48:24.538802',550,1,NULL,NULL,1,'flatcontent.blocks',868,'name','«大河恋»',''),(551,NULL,'2021-06-17 14:48:24.548950','2021-06-17 14:48:24.548997',551,1,NULL,NULL,1,'flatcontent.blocks',868,'html','','<div>渔具用品制造商LOGO<br><br><span style=\"background-color: initial;\">客户：中国义乌大河恋<br><br></span><span style=\"background-color: initial;\">大河恋公司正稳步发展，并将产品供应世界各个国家，一直以其高品质的产品和设计和良好的服务态度而著称。公司在钓具及配件的生产中广泛采用行业领先的日本技术。该公司的负责人找到我们的工作室，希望开发一个符合现代趋势的现代化LOGO，帮助提升其产品形象，在中外合作伙伴更具吸引力，同时，希望LOGO在视觉上带有浓烈的传统亚洲风格。因此，在大河恋的新LOGO创作中，我们充分考虑了客户的所有诉求，以中国传统水彩风格为基础，与现代简约风完美融合：以一条鱼和一条波浪作为LOGO的主要元素，构成一个圆圈——象征着和谐的大自然。</span></div><br>'),(552,NULL,'2021-06-17 14:54:17.817912','2021-06-17 14:54:17.817962',552,1,NULL,NULL,1,'flatcontent.blocks',866,'name','«大河恋»',''),(553,NULL,'2021-06-17 15:42:16.753933','2021-06-17 15:42:16.753971',553,1,NULL,NULL,1,'flatcontent.blocks',873,'name','«木丸子»迷宫玩具',''),(554,NULL,'2021-06-17 15:50:03.771396','2021-06-17 15:50:03.771453',554,1,NULL,NULL,1,'flatcontent.containers',104,'name','«木丸子»品牌迷宫系列玩具',''),(555,NULL,'2021-06-17 15:50:35.951690','2021-06-17 15:50:35.951738',555,1,NULL,NULL,1,'flatcontent.containers',104,'description','«木丸子»品牌迷宫系列玩具',''),(556,NULL,'2021-06-17 15:54:21.821274','2021-06-17 15:54:21.821327',556,1,NULL,NULL,1,'flatcontent.blocks',874,'html','','<div><span style=\"background-color: initial;\">客户：木丸子<br><br></span><span style=\"background-color: initial;\">我们工作室为知名木制玩具木丸子品牌设计了一系列迷宫玩具，主打美国与中国市场。与普通的迷宫玩具不同，我们添加了几个有趣的塑料“路障”——作为小隔板使用，可在路径上移动，还有圆形可旋转“交叉点”，用来改变小球在路劲上的移动方向。为了让孩子对玩具保持长期的新鲜感和兴趣，我们专门设计并绘制了插图。与其他制造商的繁杂的插图相比，我们的插图不会使用过多不必要的元素，让孩子眼花缭乱，而是更倾向于让孩子在图画中能够获取有用信息，集中注意力。</span></div>'),(557,NULL,'2021-06-17 15:56:38.943721','2021-06-17 15:56:38.943764',557,1,NULL,NULL,1,'flatcontent.blocks',883,'name','«木丸子»',''),(558,NULL,'2021-06-17 15:56:38.954818','2021-06-17 15:56:38.954875',558,1,NULL,NULL,1,'flatcontent.blocks',883,'html','迷宫玩具系列','');
